class ToggleSwitch(tk.Canvas):
    def __init__(self, parent, command=None, width=48, height=28, *args, **kwargs):
        super().__init__(parent, width=width, height=height, *args, **kwargs)
        self.command = command
        self.state = False
        self.width = width
        self.height = height
        self.configure(bg=COLORS["bg"], highlightthickness=0)
        
        # Eski renkler
        self.off_color = "#4d4d4d"  
        self.on_color = COLORS["accent"]  
        self.knob_off_color = "#FFFFFF"  
        self.knob_on_color = "#000000"   
        self.shadow_color = "#1A1A1A"
        self.hover_glow = "#00A8CC"
        self.inner_shadow_color = "#0F0F0F"
        self.knob_shadow_color = "#808080"
        
        # Hover durumu
        self.is_hovering = False
        
        self._create_modern_switch()
        self._bind_events()
        
        # Animasyon deÄŸiÅŸkenleri
        self.animation_active = False
        self.animation_steps = 25  
        self.animation_duration = 250  
        self.animation_delay = self.animation_duration // self.animation_steps

    def _create_modern_switch(self):
        self.delete("all")  
        
        radius = self.height // 2
        current_color = self.on_color if self.state else self.off_color
        
        if self.is_hovering:
            glow_color = self.hover_glow if self.state else "#606060"
            self.create_rounded_rectangle(
                -1, -1, self.width + 1, self.height + 1,
                radius + 1, fill="", outline=glow_color, width=2, tags="glow"
            )
        
        self.bg_rect = self.create_rounded_rectangle(
            0, 0, self.width, self.height,
            radius, fill=current_color, outline="", tags="bg"
        )
        
        # Knob
        knob_size = self.height - 6
        knob_x = self.width - knob_size - 3 if self.state else 3
        knob_y = 3
        
        # Ana knob - duruma gÃ¶re renk
        current_knob_color = self.knob_on_color if self.state else self.knob_off_color
        self.knob = self.create_oval(
            knob_x, knob_y,
            knob_x + knob_size, knob_y + knob_size,
            fill=current_knob_color, outline="", tags="knob"
        )

    def create_rounded_rectangle(self, x1, y1, x2, y2, radius, **kwargs):
        points = [
            x1+radius, y1,
            x2-radius, y1,
            x2, y1,
            x2, y1+radius,
            x2, y2-radius,
            x2, y2,
            x2-radius, y2,
            x1+radius, y2,
            x1, y2,
            x1, y2-radius,
            x1, y1+radius,
            x1, y1,
            x1+radius, y1
        ]
        return self.create_polygon(points, smooth=True, **kwargs)

    def _bind_events(self):
        """Event binding'leri ayarlar"""
        self.bind("<Button-1>", self.toggle)
        self.bind("<Enter>", self._on_hover_enter)
        self.bind("<Leave>", self._on_hover_leave)

    def _on_hover_enter(self, event=None):
        self.is_hovering = True
        if not self.animation_active:
            self._create_modern_switch()

    def _on_hover_leave(self, event=None):
        self.is_hovering = False
        if not self.animation_active:
            self._create_modern_switch()

    def toggle(self, event=None):
        if self.animation_active:
            return
            
        self.state = not self.state
        self.animate_modern_toggle()
        
        if self.command:
            self.command(self.state)
            
    def animate_modern_toggle(self):
        self.animation_active = True
        self._animate_modern_step(0)

    def animate_toggle(self):
        self.animate_modern_toggle()

    def _animate_modern_step(self, step):
        if step >= self.animation_steps:
            self.animation_active = False
            self._create_modern_switch() 
            return
        
        progress = step / self.animation_steps
        if progress < 0.5:
            eased_progress = 4 * progress * progress * progress
        else:
            eased_progress = 1 - pow(-2 * progress + 2, 3) / 2
        
        self._create_modern_switch_animated(eased_progress)
        
        self.after(self.animation_delay, lambda: self._animate_modern_step(step + 1))

    def _create_modern_switch_animated(self, progress):
        self.delete("all")
        
        if self.state:  
            start_color = self.off_color
            end_color = self.on_color
        else:  
            start_color = self.on_color
            end_color = self.off_color
        
        current_bg_color = self._interpolate_color(start_color, end_color, progress)
        
        radius = self.height // 2
        
        if self.is_hovering:
            glow_color = self._interpolate_color(
                "#606060" if not self.state else self.hover_glow,
                self.hover_glow if self.state else "#606060",
                progress
            )
            self.create_rounded_rectangle(
                -1, -1, self.width + 1, self.height + 1,
                radius + 1, fill="", outline=glow_color, width=2, tags="glow"
            )
        
        # Ana arkaplan
        self.create_rounded_rectangle(
            0, 0, self.width, self.height,
            radius, fill=current_bg_color, outline="", tags="bg"
        )
        
        # Knob pozisyonu interpolasyonu
        knob_size = self.height - 6
        if self.state:  # OFF -> ON
            start_x = 3
            end_x = self.width - knob_size - 3
        else:  # ON -> OFF
            start_x = self.width - knob_size - 3
            end_x = 3
        
        current_knob_x = start_x + (end_x - start_x) * progress
        knob_y = 3
        if self.state:  # OFF -> ON (Beyaz -> Siyah)
            start_knob_color = self.knob_off_color
            end_knob_color = self.knob_on_color
        else:  # ON -> OFF (Siyah -> Beyaz)
            start_knob_color = self.knob_on_color
            end_knob_color = self.knob_off_color
        
        current_knob_color = self._interpolate_color(start_knob_color, end_knob_color, progress)
        
        # Ana knob
        self.create_oval(
            current_knob_x, knob_y,
            current_knob_x + knob_size, knob_y + knob_size,
            fill=current_knob_color, outline="", tags="knob"
        )

    def _interpolate_color(self, start_color, end_color, progress):
        try:
            if start_color.startswith('#'):
                start_rgb = tuple(int(start_color[i:i+2], 16) for i in (1, 3, 5))
            else:
                start_rgb = (77, 77, 77)  
                
            if end_color.startswith('#'):
                end_rgb = tuple(int(end_color[i:i+2], 16) for i in (1, 3, 5))
            else:
                end_rgb = (77, 77, 77)  
            
            r = int(start_rgb[0] + (end_rgb[0] - start_rgb[0]) * progress)
            g = int(start_rgb[1] + (end_rgb[1] - start_rgb[1]) * progress)
            b = int(start_rgb[2] + (end_rgb[2] - start_rgb[2]) * progress)
            
            return f"#{r:02x}{g:02x}{b:02x}"
        except:
            return end_color
            
            
    def set_state(self, value: bool, animate=True):
        if self.state != value:
            if animate:
                self.toggle()  
            else:
                self._set_immediate(value)  

    def _set_immediate(self, value: bool):
        self.state = value
        self._create_modern_switch()

    def get_state(self):
        return self.state   

    def set(self, value: bool, animate=True):
        self.set_state(value, animate)

    def get(self):
        return self.state

