class CustomCTkDropdown(ctk.CTkFrame):
    def __init__(self, master, values, width=200, height=36, font=("Segoe UI", 13, "bold"), fg_color="#1E1E1E", text_color="#fff", accent="#F5F5F5", command=None, **kwargs):
        super().__init__(master, fg_color=fg_color, **kwargs)
        self.values = values
        self.selected = ctk.StringVar(value=values[0])
        self.width = width
        self.height = height
        self.font = font
        self.fg_color = fg_color
        self.text_color = text_color
        self.accent = accent
        self.command = command
        self.shadow = ctk.CTkFrame(self, fg_color="#181818", corner_radius=14)
        self.shadow.pack(padx=2, pady=4, fill="both", expand=True)
        self.inner = ctk.CTkFrame(self.shadow, fg_color=fg_color, corner_radius=12)
        self.inner.pack(padx=0, pady=0, fill="both", expand=True)
        self.button = ctk.CTkButton(
            self.inner, textvariable=self.selected, width=width, height=height,
            fg_color=fg_color, text_color=text_color, font=font,
            hover_color=fg_color, anchor="w", command=self.show_dropdown,
            corner_radius=12, border_width=2, border_color="#343434"
        )
        
        self.button._hover_animation_active = False
        self.button._main_hover_animation_id = None
        self.button._original_fg_color = fg_color
        self.button._target_fg_color = accent
        self.button.bind("<Enter>", lambda e: self.start_main_button_hover(True))
        self.button.bind("<Leave>", lambda e: self.start_main_button_hover(False))
        self.button.pack(fill="x", expand=True, padx=(0, 32), pady=0)
        self.arrow_canvas = ctk.CTkCanvas(self.inner, width=18, height=18, bg=self.fg_color, highlightthickness=0)
        self.arrow_canvas.place(relx=0.97, rely=0.5, anchor="e")
        self.draw_arrow()

    def draw_arrow(self):
        self.arrow_canvas.delete("all")
        cx, cy, size = 9, 9, 5
        points = [
            (cx - size, cy - size//2),
            (cx + size, cy - size//2),
            (cx, cy + size//1.2)
        ]
        self.arrow_canvas.create_polygon(points, fill=self.accent, outline="")

    def start_main_button_hover(self, is_entering):
        if not self.button.winfo_exists():
            return

        if hasattr(self.button, '_main_hover_animation_id'):
            try:
                self.button.after_cancel(self.button._main_hover_animation_id)
            except:
                pass
            self.button._main_hover_animation_id = None
            
        self.button._hover_animation_active = True
        
        try:
            current_fg = self.button.cget("fg_color")
        except:
            self.button._hover_animation_active = False
            return
        
        if is_entering:
            target_fg = self.button._target_fg_color
        else:
            target_fg = self.button._original_fg_color
        
        animation_steps = 18
        animation_duration = 180  # ms
        step_delay = max(8, animation_duration // animation_steps)
        
        self._animate_main_button_hover_step(0, animation_steps, current_fg, target_fg, step_delay)

    def _animate_main_button_hover_step(self, current_step, total_steps, start_fg, target_fg, step_delay):
        if not self.button.winfo_exists() or not self.button._hover_animation_active:
            return
            
        if current_step >= total_steps:
            self.button._hover_animation_active = False
            self.button._main_hover_animation_id = None
            try:
                self.button.configure(fg_color=target_fg)
            except:
                pass
            return
        
        progress = current_step / total_steps
        if progress < 0.5:
            eased_progress = 4 * progress * progress * progress
        else:
            eased_progress = 1 - pow(-2 * progress + 2, 3) / 2
        
        current_fg_color = self._interpolate_color_dropdown(start_fg, target_fg, eased_progress)
        
        try:
            self.button.configure(fg_color=current_fg_color)
        except:
            self.button._hover_animation_active = False
            return
        
        try:
            self.button._main_hover_animation_id = self.button.after(step_delay, lambda: self._animate_main_button_hover_step(
                current_step + 1, total_steps, start_fg, target_fg, step_delay
            ))
        except:
            self.button._hover_animation_active = False
            self.button._main_hover_animation_id = None

    def show_dropdown(self):
        if hasattr(self, 'dropdown') and self.dropdown and self.dropdown.winfo_exists():
            self.start_smooth_dropdown_close_animation()
            return
        max_visible = min(6, len(self.values))
        menu_height = max_visible * (self.height + 2)
        self.dropdown = ctk.CTkToplevel(self)
        self.dropdown.transient(self.master)
        self.dropdown.overrideredirect(True)
        self.dropdown.geometry(f"{self.width}x{menu_height}+{self.winfo_rootx()}+{self.winfo_rooty() + self.winfo_height()}")
        self.dropdown.lift()
        self.dropdown.attributes("-topmost", True)
        try:
            self.dropdown.attributes("-alpha", 0.0)
            self.dropdown.attributes("-toolwindow", True)
        except Exception:
            pass
        if hasattr(self.master, 'apply_streamproof_to_window'):
            try:
                self.master.apply_streamproof_to_window(self.dropdown)
            except Exception:
                pass

        drop_shadow = ctk.CTkFrame(self.dropdown, fg_color="#181818", corner_radius=12)
        drop_shadow.pack(padx=2, pady=4, fill="both", expand=True)
        drop_inner = ctk.CTkFrame(drop_shadow, fg_color=self.fg_color, corner_radius=10)
        drop_inner.pack(padx=0, pady=0, fill="both", expand=True)
        canvas = ctk.CTkCanvas(drop_inner, width=self.width-8, height=menu_height, bg=self.fg_color, highlightthickness=0)
        canvas.pack(side="left", fill="both", expand=True)
        scrollbar = ctk.CTkScrollbar(drop_inner, orientation="vertical", command=canvas.yview)
        scrollbar.pack(side="right", fill="y")
        frame = ctk.CTkFrame(canvas, fg_color=self.fg_color)
        frame_id = canvas.create_window((0,0), window=frame, anchor="nw")
        canvas.configure(yscrollcommand=scrollbar.set)

        def on_frame_configure(event):
            canvas.configure(scrollregion=canvas.bbox("all"))
        frame.bind("<Configure>", on_frame_configure)

        def _on_mousewheel(event):
            canvas.yview_scroll(int(-1*(event.delta/120)), "units")
        canvas.bind_all("<MouseWheel>", _on_mousewheel)

        btn_refs = []
        for i, value in enumerate(self.values):
            btn = ctk.CTkButton(
                frame, text=value, width=self.width-24, height=self.height,
                fg_color=self.accent if value == self.selected.get() else self.fg_color,
                text_color="#fff" if value == self.selected.get() else "#fff",
                font=self.font,
                hover_color=self.fg_color,
                anchor="w",
                command=lambda v=value: self.select_value(v),
                corner_radius=8,
                border_width=0
            )
            
            btn._hover_animation_active = False
            btn._hover_animation_id = None
            btn._hover_target_state = False
            btn._original_fg_color = self.accent if value == self.selected.get() else self.fg_color
            btn._original_text_color = "#fff"
            btn._target_fg_color = "#F5F5F5"
            btn._target_text_color = "#000"
            btn._dropdown_ref = self
            btn._value = value
            
            def on_enter(event, button=btn):
                self.start_smooth_hover_animation(button, True)
            
            def on_leave(event, button=btn):
                self.start_smooth_hover_animation(button, False)
            
            btn.bind("<Enter>", on_enter)
            btn.bind("<Leave>", on_leave)
            
            btn.pack(fill="x", expand=True, padx=6, pady=(0,0))
            btn_refs.append(btn)
            if i < len(self.values) - 1:
                sep_canvas = ctk.CTkCanvas(frame, width=self.width-32, height=2, bg=self.fg_color, highlightthickness=0)
                sep_canvas.pack(fill="x", padx=12)
                sep_canvas.create_line(0, 1, self.width-32, 1, fill="#232323", width=1)

        self.dropdown.bind("<FocusOut>", lambda e: self.close_dropdown())
        self.dropdown.focus_set()

        self.start_smooth_dropdown_animation(menu_height)

    def start_smooth_hover_animation(self, button, is_entering):
        if not button.winfo_exists():
            return
            
        if hasattr(button, '_hover_animation_id'):
            try:
                button.after_cancel(button._hover_animation_id)
            except:
                pass
            button._hover_animation_id = None
            
        button._hover_animation_active = True
        button._hover_target_state = is_entering
        
        try:
            current_fg = button.cget("fg_color")
            current_text = button.cget("text_color")
        except:
            button._hover_animation_active = False
            return
        
        if is_entering:
            target_fg = button._target_fg_color
            target_text = button._target_text_color
        else:
            if hasattr(button, '_value') and button._value == self.selected.get():
                button._original_fg_color = self.accent
            else:
                button._original_fg_color = self.fg_color
            target_fg = button._original_fg_color
            target_text = button._original_text_color
        
        animation_steps = 20
        animation_duration = 200  # ms
        step_delay = max(8, animation_duration // animation_steps)
        
        self._animate_hover_step(button, 0, animation_steps, current_fg, target_fg, 
                                current_text, target_text, step_delay)

    def _animate_hover_step(self, button, current_step, total_steps, start_fg, target_fg, 
                           start_text, target_text, step_delay):
        if not button.winfo_exists() or not button._hover_animation_active:
            return
            
        if current_step >= total_steps:
            button._hover_animation_active = False
            button._hover_animation_id = None
            try:
                button.configure(fg_color=target_fg, text_color=target_text)
            except:
                pass
            return
        
        progress = current_step / total_steps
        if progress < 0.5:
            eased_progress = 4 * progress * progress * progress
        else:
            eased_progress = 1 - pow(-2 * progress + 2, 3) / 2
        
        current_fg_color = self._interpolate_color_dropdown(start_fg, target_fg, eased_progress)
        current_text_color = self._interpolate_color_dropdown(start_text, target_text, eased_progress)
        
        try:
            button.configure(fg_color=current_fg_color, text_color=current_text_color)
        except:
            button._hover_animation_active = False
            return
        
        try:
            button._hover_animation_id = button.after(step_delay, lambda: self._animate_hover_step(
                button, current_step + 1, total_steps, start_fg, target_fg,
                start_text, target_text, step_delay
            ))
        except:
            button._hover_animation_active = False
            button._hover_animation_id = None

    def _interpolate_color_dropdown(self, start_color, end_color, progress):
        try:
            progress = max(0.0, min(1.0, progress))
            
            start_hex = self._normalize_color(start_color)
            end_hex = self._normalize_color(end_color)
            
            start_rgb = tuple(int(start_hex[i:i+2], 16) for i in (1, 3, 5))
            end_rgb = tuple(int(end_hex[i:i+2], 16) for i in (1, 3, 5))
            
            gamma = 2.2
            
            def linear_to_srgb(value):
                return pow(value / 255.0, gamma)
            
            def srgb_to_linear(value):
                return pow(value, 1.0 / gamma) * 255.0
            
            start_linear = [linear_to_srgb(c) for c in start_rgb]
            end_linear = [linear_to_srgb(c) for c in end_rgb]
            
            current_linear = [
                start_linear[i] + (end_linear[i] - start_linear[i]) * progress
                for i in range(3)
            ]
            
            current_rgb = [int(srgb_to_linear(c)) for c in current_linear]
            
            r = max(0, min(255, current_rgb[0]))
            g = max(0, min(255, current_rgb[1]))
            b = max(0, min(255, current_rgb[2]))
            
            return f"#{r:02x}{g:02x}{b:02x}"
        except:
            return self._normalize_color(end_color)

    def _normalize_color(self, color):
        try:
            if isinstance(color, str):
                if color.startswith('#') and len(color) == 7:
                    return color
                elif color.startswith('#') and len(color) == 4:
                    return f"#{color[1]}{color[1]}{color[2]}{color[2]}{color[3]}{color[3]}"
            
            if str(color).lower() in ['white', '#ffffff', '#fff']:
                return "#FFFFFF"
            elif str(color).lower() in ['black', '#000000', '#000']:
                return "#000000"
            
            return "#1E1E1E"
        except:
            return "#1E1E1E"

    def start_smooth_dropdown_animation(self, target_height):
        if not hasattr(self, 'dropdown') or not self.dropdown.winfo_exists():
            return
            
        animation_steps = 20
        animation_duration = 200
        step_delay = animation_duration // animation_steps
        
        start_height = 0
        start_alpha = 0.0
        
        self.dropdown.geometry(f"{self.width}x{start_height}+{self.winfo_rootx()}+{self.winfo_rooty() + self.winfo_height()}")
        self.dropdown.attributes("-alpha", start_alpha)
        
        self._animate_dropdown_step(0, animation_steps, start_height, target_height, start_alpha, 1.0, step_delay)

    def _animate_dropdown_step(self, current_step, total_steps, start_height, target_height, start_alpha, target_alpha, step_delay):
        if not hasattr(self, 'dropdown') or not self.dropdown.winfo_exists():
            return
            
        if current_step >= total_steps:
            try:
                self.dropdown.geometry(f"{self.width}x{target_height}+{self.winfo_rootx()}+{self.winfo_rooty() + self.winfo_height()}")
                self.dropdown.attributes("-alpha", target_alpha)
            except:
                pass
            return
        
        progress = current_step / total_steps
        eased_progress = 1 - pow(1 - progress, 3)
        
        current_height = int(start_height + (target_height - start_height) * eased_progress)
        
        alpha_progress = min(1.0, progress * 1.5)
        current_alpha = start_alpha + (target_alpha - start_alpha) * alpha_progress
        
        try:
            self.dropdown.geometry(f"{self.width}x{current_height}+{self.winfo_rootx()}+{self.winfo_rooty() + self.winfo_height()}")
            self.dropdown.attributes("-alpha", current_alpha)
        except:
            return
        
        self.dropdown.after(step_delay, lambda: self._animate_dropdown_step(
            current_step + 1, total_steps, start_height, target_height, 
            start_alpha, target_alpha, step_delay
        ))

    def close_dropdown(self):
        if hasattr(self, 'dropdown') and self.dropdown and self.dropdown.winfo_exists():
            self.start_smooth_dropdown_close_animation()

    def start_smooth_dropdown_close_animation(self):
        if not hasattr(self, 'dropdown') or not self.dropdown.winfo_exists():
            return
            
        try:
            geometry = self.dropdown.geometry()
            current_height = int(geometry.split('x')[1].split('+')[0])
            current_alpha = self.dropdown.attributes("-alpha")
        except:
            self.dropdown.destroy()
            return
        
        animation_steps = 15
        animation_duration = 150
        step_delay = animation_duration // animation_steps
        
        target_height = 0
        target_alpha = 0.0
        
        self._animate_dropdown_close_step(0, animation_steps, current_height, target_height, current_alpha, target_alpha, step_delay)

    def _animate_dropdown_close_step(self, current_step, total_steps, start_height, target_height, start_alpha, target_alpha, step_delay):
        if not hasattr(self, 'dropdown') or not self.dropdown.winfo_exists():
            return
            
        if current_step >= total_steps:
            try:
                self.dropdown.destroy()
            except:
                pass
            return
        
        progress = current_step / total_steps
        eased_progress = progress * progress * progress
        
        current_height = int(start_height + (target_height - start_height) * eased_progress)
        
        alpha_progress = min(1.0, progress * 1.8)
        current_alpha = start_alpha + (target_alpha - start_alpha) * alpha_progress
        
        try:
            self.dropdown.geometry(f"{self.width}x{current_height}+{self.winfo_rootx()}+{self.winfo_rooty() + self.winfo_height()}")
            self.dropdown.attributes("-alpha", current_alpha)
        except:
            try:
                self.dropdown.destroy()
            except:
                pass
            return
        
        self.dropdown.after(step_delay, lambda: self._animate_dropdown_close_step(
            current_step + 1, total_steps, start_height, target_height, 
            start_alpha, target_alpha, step_delay
        ))

    def select_value(self, value):
        self.selected.set(value)
        if hasattr(self, 'dropdown') and self.dropdown and self.dropdown.winfo_exists():
            self.start_smooth_dropdown_close_animation()
        if self.command:
            self.command(value)

    def get(self):
        return self.selected.get()

    def set(self, value):
        if value in self.values:
            self.selected.set(value)

