        state[0:4] = constants[0:4]
        state[4:8] = key_hash[0:4]
        state[8:12] = key_hash[4:8]
        state[12:16] = key_hash[8:12]
        state[16:20] = key_hash[12:16]
        state[20:24] = constants[4:8]
        state[24:28] = nonce[0:4]
        state[28:32] = nonce[4:8]
        state[32:36] = (0).to_bytes(4, byteorder='little')
        state[36:40] = (0).to_bytes(4, byteorder='little')
        state[40:44] = constants[8:12]
        state[44:48] = key_hash[16:20]
        state[48:52] = key_hash[20:24]
        state[52:56] = key_hash[24:28]
        state[56:60] = key_hash[28:32]
        state[60:64] = constants[12:16]
        
