        for i in range(0, len(data), 64):
            block_data = data[i:i+64]
            block_len = len(block_data)
            
            encrypt_block = bytearray(state)
            for _ in range(10):
                encrypt_block[0], encrypt_block[4], encrypt_block[8], encrypt_block[12] = self._salsa20_quarter_round(
                    encrypt_block[0], encrypt_block[4], encrypt_block[8], encrypt_block[12])
                encrypt_block[5], encrypt_block[9], encrypt_block[13], encrypt_block[1] = self._salsa20_quarter_round(
                    encrypt_block[5], encrypt_block[9], encrypt_block[13], encrypt_block[1])
                encrypt_block[10], encrypt_block[14], encrypt_block[2], encrypt_block[6] = self._salsa20_quarter_round(
                    encrypt_block[10], encrypt_block[14], encrypt_block[2], encrypt_block[6])
                encrypt_block[15], encrypt_block[3], encrypt_block[7], encrypt_block[11] = self._salsa20_quarter_round(
                    encrypt_block[15], encrypt_block[3], encrypt_block[7], encrypt_block[11])
                encrypt_block[0], encrypt_block[1], encrypt_block[2], encrypt_block[3] = self._salsa20_quarter_round(
                    encrypt_block[0], encrypt_block[1], encrypt_block[2], encrypt_block[3])
                encrypt_block[5], encrypt_block[6], encrypt_block[7], encrypt_block[4] = self._salsa20_quarter_round(
                    encrypt_block[5], encrypt_block[6], encrypt_block[7], encrypt_block[4])
