    def is_debugger_present(self):
        if sys.gettrace() is not None:
            return True
        
        try:
            if ctypes.windll.kernel32.IsDebuggerPresent():
                return True
        except: pass
        
        try:
            isDebuggerPresent = ctypes.c_bool(False)
            ctypes.windll.kernel32.CheckRemoteDebuggerPresent(
                ctypes.windll.kernel32.GetCurrentProcess(), 
                ctypes.byref(isDebuggerPresent)
            )
            if isDebuggerPresent.value:
                return True
        except: pass
        
        try:
            class PROCESS_INFORMATION(ctypes.Structure):
                _fields_ = [("hProcess", ctypes.c_void_p),
                            ("hThread", ctypes.c_void_p),
                            ("dwProcessId", ctypes.c_ulong),
                            ("dwThreadId", ctypes.c_ulong)]
                            
            ProcessDebugPort = 7
            hProcess = ctypes.windll.kernel32.GetCurrentProcess()
            debug_port = ctypes.c_ulong(0)
            status = ctypes.windll.ntdll.NtQueryInformationProcess(
                hProcess,
                ProcessDebugPort,
                ctypes.byref(debug_port),
                ctypes.sizeof(debug_port),
                None
            )
            if status == 0 and debug_port.value != 0:
                return True
        except: pass
        
        try:
            startTime = time.time()
            for i in range(1000):
                x = i * i
            endTime = time.time()
            timeDiff = endTime - startTime
            if timeDiff < 0.001:
                return True
        except: pass
        
        for arg in sys.argv:
            if any(x in arg for x in ["--inspect", "--debug", "--trace", "--profile", "-d", "-pdb"]):
                return True
                
        for mod in sys.modules:
            if any(x in mod for x in ["pydevd", "pdb", "ipdb", "pycharm", "debugpy", "pydevconsole", "trace", "debugger", "winpdb"]):
                return True
                
        for k in os.environ:
            if "PYTHON" in k and ("DEBUG" in k or "INSPECT" in k or "TRACE" in k):
                return True
                
        if any(dbg in sys.executable.lower() for dbg in ["debug", "pycharm", "vscode", "idle"]):
            return True
            
        return False

