    def _check_process_suspension(self):
        try:
            current_time = time.time()
            
            try:
                cpu_percent = psutil.cpu_percent(interval=1)
                if cpu_percent < 0.1 and (current_time - self._last_check_time) > 10:
                    self._log(f"CPU usage unusually low: {cpu_percent}%")
                    return True
            except:
                pass
            
            try:
                memory = psutil.virtual_memory()
                if memory.available > memory.total * 0.95 and (current_time - self._last_check_time) > 15:
                    self._log("Memory usage unusually low")
                    return True
            except:
                pass
            
            if hasattr(self, '_last_check_time'):
                time_diff = current_time - self._last_check_time
                if time_diff > 20:
                    self._log(f"Time delay detected: {time_diff:.2f} seconds")
                    return True
            
            try:
                current_process = psutil.Process()
                if current_process.status() == psutil.STATUS_STOPPED and (current_time - self._last_check_time) > 30:
                    self._log("Process status: STOPPED")
                    return True
            except:
                pass
            
            self._last_check_time = current_time
            return False
            
        except Exception as e:
            self._log(f"Process suspension control error: {str(e)}")
            return False

    def _check_self_suspension_protection(self):
        try:
            current_time = time.time()
            
            current_process = psutil.Process()
            
            try:
                status = current_process.status()
                if status == psutil.STATUS_STOPPED:
                    if hasattr(self, '_stopped_start_time'):
                        if current_time - self._stopped_start_time > 10:
                            self._log("Our process is long-term STOPPED - REAL THREAT!")
                            self._aggressive_defense("SELF_SUSPEND", "Proses uzun sÃ¼re STOPPED")
                            return True
                    else:
                        self._stopped_start_time = current_time
                        return False
                else:
                    if hasattr(self, '_stopped_start_time'):
                        delattr(self, '_stopped_start_time')
            except:
                pass
            
            if hasattr(self, '_last_self_check_time'):
                time_diff = current_time - self._last_self_check_time
                if time_diff > 60:
                    self._log(f"Our process has a long time delay: {time_diff:.2f} seconds - REAL THREAT!")
                    self._aggressive_defense("SELF_SUSPEND", f"Long time delay: {time_diff:.2f}s")
                    return True
            
            try:
                current_pid = current_process.pid
                if hasattr(self, '_last_pid'):
                    if current_pid != self._last_pid:
                        self._log(f"Process ID changed: {self._last_pid} -> {current_pid} - REAL THREAT!")
                        self._aggressive_defense("SELF_SUSPEND", "Process ID change")
                        return True
                self._last_pid = current_pid
            except:
                pass
            
            try:
                num_handles = current_process.num_handles()
                if num_handles < 5:
                    if hasattr(self, '_low_handles_start_time'):
                        if current_time - self._low_handles_start_time > 30:
                            self._log("Our process has a long-term abnormal low handle count - REAL THREAT!")
                            self._aggressive_defense("SELF_SUSPEND", "Long-term abnormal low handle count")
                            return True
                    else:
                        self._low_handles_start_time = current_time
                        return False
                else:
                    if hasattr(self, '_low_handles_start_time'):
                        delattr(self, '_low_handles_start_time')
            except:
                pass
            
            self._last_self_check_time = current_time
            return False
            
        except Exception as e:
            self._log(f"Own process suspension protection error: {str(e)}")
            return False

