    def _is_safe_program(self, process_name, process_path="", cmdline=""):
        try:
            proc_name = process_name.lower()
            proc_path = process_path.lower()
            proc_cmdline = cmdline.lower()
            
            if proc_name in self.safe_programs:
                return True
            
            system_paths = [
                "c:\\windows\\system32", "c:\\windows\\syswow64", 
                "c:\\program files", "c:\\program files (x86)"
            ]
            if any(path in proc_path for path in system_paths):
                return True
            
            try:
                if any(pattern in proc_path for pattern in self.gaming_patterns):
                    return True
                
                for p in psutil.process_iter(['name', 'pid']):
                    if p.info['name'] and p.info['name'].lower() == proc_name:
                        current_proc = psutil.Process(p.info['pid'])
                        memory_mb = current_proc.memory_info().rss / 1024 / 1024
                        
                        if memory_mb > 200:
                            game_indicators = [
                                "game", "launcher", "client", "player", "engine", 
                                "render", "graphics", "audio", "steam", "epic", 
                                "origin", "uplay", "battle", "riot"
                            ]
                            if any(indicator in proc_name for indicator in game_indicators):
                                return True
                            
                            if any(folder in proc_path for folder in [
                                "steam", "epic", "origin", "uplay", "games", "riot"
                            ]):
                                return True
                        break
                        
            except:
                pass
            
            safe_company_folders = [
                "steam", "epic games", "origin", "uplay", "battle.net", "riot games",
                "spotify", "discord", "chrome", "firefox", "microsoft", "adobe",
                "nvidia", "amd", "intel", "realtek", "logitech", "razer", "steelseries",
                "obs studio", "streamlabs", "twitch", "youtube"
            ]
            if any(folder in proc_path for folder in safe_company_folders):
                return True
            
            trusted_publishers = [
                "microsoft", "valve", "epic games", "riot games", "blizzard", 
                "nvidia", "amd", "intel", "adobe", "google", "mozilla"
            ]
            if any(publisher in proc_path for publisher in trusted_publishers):
                return True
            
            safe_process_patterns = [
                "helper", "service", "updater", "installer", "setup", "launcher",
                "webhelper", "crashhandler", "errorreporter", "tray", "overlay"
            ]
            if any(pattern in proc_name for pattern in safe_process_patterns):
                return True
                
            return False
            
        except Exception as e:
            return False

