class ModernEntry(tk.Entry):
    def __init__(self, master=None, **kwargs):
        self.placeholder = kwargs.pop('placeholder', '')
        self.placeholder_color = kwargs.pop('placeholder_color', '#666666')
        self.normal_color = kwargs.pop('normal_color', COLORS["fg"])
        self.border_color = kwargs.pop('border_color', "#545454")
        self.focus_color = kwargs.pop('focus_color', COLORS["accent"])
        
        kwargs.setdefault('borderwidth', 4)
        kwargs.setdefault('relief', 'flat')
        kwargs.setdefault('font', ("Segoe UI", 10, "bold"))
        kwargs.setdefault('background', COLORS["button_bg"])
        kwargs.setdefault('foreground', self.placeholder_color)
        kwargs.setdefault('insertbackground', COLORS["fg"])
        kwargs.setdefault('highlightthickness', 1)
        kwargs.setdefault('highlightbackground', self.border_color)
        kwargs.setdefault('highlightcolor', self.focus_color)
        
        super().__init__(master, **kwargs)
        
        self.original_insert = tk.Entry.insert.__get__(self, tk.Entry)
        
        if self.placeholder:
            self.original_insert(0, self.placeholder)
        
        self.has_content = False
        
        self.typing_chars = []
        self.typing_in_progress = False
        self.typing_speed = 1
        
        self.text_animation_active = False
        self.text_opacity = 1.0
        self.text_animation_speed = 0.05
        self.text_min_opacity = 0.7
        self.text_max_opacity = 1.0
        self.text_colors = []
        
        self.cursor_animation_active = False
        self.cursor_opacity = 1.0
        self.cursor_fade_direction = -1
        self.cursor_animation_speed = 0.05
        self.cursor_min_opacity = 0.3
        self.cursor_max_opacity = 1.0
        self.cursor_colors = []
        
        self.border_animation_active = False
        self.border_current_color = self.border_color
        self.border_target_color = self.focus_color
        self.border_animation_progress = 0.0
        self.border_animation_speed = 0.05
        self.border_animation_steps = 20
        self.border_colors = []
        
        self.bind("<FocusIn>", self._on_focus_in)
        self.bind("<FocusOut>", self._on_focus_out)
        self.bind("<Key>", self._on_key_press)
        self.bind("<<Cut>>", self._after_change)
        self.bind("<<Paste>>", self._after_change)
        
        self.configure(insertwidth=2)
        
        for i in range(20):
            ratio = i / 20
            r = int(255 * (1 - ratio))
            g = int(255 * (1 - ratio))
            b = int(255 * (1 - ratio))
            self.cursor_colors.append(f"#{r:02x}{g:02x}{b:02x}")
        
        for i in range(20):
            ratio = i / 20
            opacity = self.text_min_opacity + (self.text_max_opacity - self.text_min_opacity) * ratio
            r = int(255 * opacity)
            g = int(255 * opacity)
            b = int(255 * opacity)
            self.text_colors.append(f"#{r:02x}{g:02x}{b:02x}")
            
        border_from = self.hex_to_rgb(self.border_color)
        border_to = self.hex_to_rgb(self.focus_color)
        for i in range(self.border_animation_steps):
            ratio = i / (self.border_animation_steps - 1)
            r = int(border_from[0] + (border_to[0] - border_from[0]) * ratio)
            g = int(border_from[1] + (border_to[1] - border_from[1]) * ratio)
            b = int(border_from[2] + (border_to[2] - border_from[2]) * ratio)
            self.border_colors.append(f"#{r:02x}{g:02x}{b:02x}")
            
        self._start_cursor_animation()
        
    def hex_to_rgb(self, color):
        color = color.lstrip('#')
        return tuple(int(color[i:i+2], 16) for i in (0, 2, 4))
        
            
    def _on_key_press(self, event):
        if event.keysym in ('BackSpace', 'Delete'):
            self.after(1, self._after_change)
            return
            
        if len(event.char) > 0 and ord(event.char) >= 32:
            self.has_content = True
            
    def _after_change(self, event=None):
        if not self.get():
            self.has_content = False
            
    def insert(self, index, text):
        if not self.focus_get() == self or text == self.placeholder:
            return super().insert(index, text)
        
        if not text:
            return
            
        if self.typing_in_progress:
            self.after_cancel(self._typing_job)
            for char_id in self.typing_chars:
                self.after_cancel(char_id)
            self.typing_chars = []
            
        self.typing_in_progress = True
        self._type_next_char(index, list(text), 0)
        
    def _type_next_char(self, index, chars, pos):
        if pos < len(chars):
            self.original_insert(index + pos, chars[pos])
            self._typing_job = self.after(self.typing_speed, 
                                         lambda: self._type_next_char(index, chars, pos + 1))
            self.typing_chars.append(self._typing_job)
        else:
            self.typing_in_progress = False
            self.typing_chars = []
            self.has_content = bool(self.get())
            
    def _start_cursor_animation(self):
        if not self.cursor_animation_active:
            self.cursor_animation_active = True
            self._animate_cursor()
            
    def _stop_cursor_animation(self):
        self.cursor_animation_active = False
        self.config(insertbackground=COLORS["fg"])
        
    def _animate_cursor(self):
        if not self.cursor_animation_active:
            return
            
        try:
            self.cursor_opacity += self.cursor_fade_direction * self.cursor_animation_speed
            
            if self.cursor_opacity <= self.cursor_min_opacity:
                self.cursor_fade_direction = 1
                self.cursor_opacity = self.cursor_min_opacity
            elif self.cursor_opacity >= self.cursor_max_opacity:
                self.cursor_fade_direction = -1
                self.cursor_opacity = self.cursor_max_opacity
                
            color_index = int(self.cursor_opacity * 19)
            color_index = max(0, min(19, color_index))
            cursor_color = self.cursor_colors[color_index]
            
            self.config(insertbackground=cursor_color)
            
            self.after(30, self._animate_cursor)
        except Exception as e:
            print(f"Cursor animation error: {str(e)}")
            
    def _start_text_animation(self):
        if not self.text_animation_active:
            self.text_animation_active = True
            self._animate_text()
            
    def _stop_text_animation(self):
        self.text_animation_active = False
        if self.has_content:
            self.config(foreground=self.normal_color)
        else:
            self.config(foreground=self.placeholder_color)
            
    def _animate_text(self):
        if not self.text_animation_active:
            return
            
        try:
            if self.has_content and self.focus_get() == self:
                phase = (time.time() * 3) % (2 * math.pi)
                opacity_ratio = (math.sin(phase) + 1) / 2
                
                color_index = int(opacity_ratio * 19)
                color_index = max(0, min(19, color_index))
                text_color = self.text_colors[color_index]
                
                self.config(foreground=text_color)
                
            self.after(30, self._animate_text)
        except Exception as e:
            print(f"Text animation error: {str(e)}")
            
    def _start_border_animation(self, to_focus=True):
        self.border_animation_active = True
        self.border_animation_progress = 0.0
        
        if to_focus:
            self.border_target_color = self.focus_color
            self.border_animation_direction = 1
        else:
            self.border_target_color = self.border_color
            self.border_animation_direction = -1
            
        self._animate_border()
        
    def _stop_border_animation(self):
        self.border_animation_active = False
        
    def _animate_border(self):
        if not self.border_animation_active:
            return
            
        try:
            self.border_animation_progress += self.border_animation_speed
            
            if self.border_animation_progress >= 1.0:
                if self.border_animation_direction == 1:
                    self.config(highlightbackground=self.focus_color)
                else:
                    self.config(highlightbackground=self.border_color)
                self.border_animation_active = False
                return
                
            if self.border_animation_direction == 1:
                color_index = int(self.border_animation_progress * (self.border_animation_steps - 1))
            else:
                color_index = int((1 - self.border_animation_progress) * (self.border_animation_steps - 1))
                
            color_index = max(0, min(self.border_animation_steps - 1, color_index))
            border_color = self.border_colors[color_index]
            
            self.config(highlightbackground=border_color)
            
            self.after(20, self._animate_border)
        except Exception as e:
            print(f"Border animation error: {str(e)}")
            
    def _on_focus_in(self, event):
        if not self.has_content and self.get() == self.placeholder:
            self.delete(0, tk.END)
            self.config(foreground=self.normal_color)
            if hasattr(self, 'show') and self.show:
                self.config(show="*")
        
        self._start_cursor_animation()
        self._start_text_animation()
        self._start_border_animation(to_focus=True)
                
    def _on_focus_out(self, event):
        if not self.get():
            self.insert(0, self.placeholder)
            self.config(foreground=self.placeholder_color)
            self.has_content = False
            if hasattr(self, 'show') and self.show:
                self.config(show="")
        else:
            self.has_content = True
            
        self._stop_cursor_animation()
        self._stop_text_animation()
        self._start_border_animation(to_focus=False)
            
    def set_placeholder(self, text):
        self.placeholder = text
        if not self.has_content:
            self.delete(0, tk.END)
            self.insert(0, text)
            self.config(foreground=self.placeholder_color)


class FadeButton(tk.Button):
    def __init__(self, master=None, normal_bg=None, hover_bg=None, **kwargs):
        self.custom_normal_bg = normal_bg or "#FFFFFF"
        self.custom_hover_bg = hover_bg or "#000000"
        self.normal_fg = kwargs.pop('fg', "#000000")
        self.hover_fg = kwargs.pop('hover_fg', "#FFFFFF")
        
        self.button_text = kwargs.get('text', 'Button')
        
        self.use_text_animation = kwargs.pop('use_text_animation', True)
        
        super().__init__(
            master,
            bg=self.custom_normal_bg,
            fg=self.normal_fg,
            relief='flat',
            borderwidth=0,
            **kwargs
        )

        self.fade_steps = 20
        self.fade_speed = 15
        self.current_step = 0
        self.fade_running = False
        self.fade_animation_id = None

        self.text_animation_active = False
        self.char_frames = []
        self.char_labels = []
        self.char_states = []
        self.min_opacity = 0.1
        self.max_opacity = 1.0
        
        self.is_hovering = False
        self.hover_debounce_id = None
        
        self.bind("<Enter>", self._on_enter)
        self.bind("<Leave>", self._on_leave)
        
        if self.use_text_animation:
            self.after(100, self.setup_text_animation)

    def _on_enter(self, event):
        if self.hover_debounce_id:
            self.after_cancel(self.hover_debounce_id)
        
        if not self.is_hovering:
            self.is_hovering = True
            self.hover_debounce_id = self.after(10, lambda: self.start_fade(
                self.hex_to_rgb(self.custom_normal_bg),
                self.hex_to_rgb(self.custom_hover_bg)
            ))

    def _on_leave(self, event):
        if self.hover_debounce_id:
            self.after_cancel(self.hover_debounce_id)
        
        if self.is_hovering:
            self.is_hovering = False
            self.hover_debounce_id = self.after(10, lambda: self.start_fade(
                self.hex_to_rgb(self.custom_hover_bg),
                self.hex_to_rgb(self.custom_normal_bg)
            ))

    def setup_text_animation(self):
        try:
            if not self.winfo_exists():
                return
                
            self.config(text="")
            
            self.text_frame = tk.Frame(self, bg=self.cget('bg'))
            self.text_frame.place(relx=0.5, rely=0.5, anchor="center")
            
            def safe_invoke(event):
                try:
                    if hasattr(self, 'winfo_exists') and self.winfo_exists():
                        self.invoke()
                except Exception as e:
                    print(f"Safe invoke error: {e}")
            
            def safe_event_generate(event_type):
                def handler(event):
                    try:
                        if hasattr(self, 'winfo_exists') and self.winfo_exists():
                            self.event_generate(event_type)
                    except Exception as e:
                        print(f"Safe event generate error: {e}")
                return handler
            
            try:
                self.text_frame.bind("<Button-1>", safe_invoke)
                self.text_frame.bind("<ButtonRelease-1>", safe_event_generate("<ButtonRelease-1>"))
                self.text_frame.bind("<Enter>", safe_event_generate("<Enter>"))
                self.text_frame.bind("<Leave>", safe_event_generate("<Leave>"))
            except Exception as e:
                print(f"Text frame binding error: {e}")
            
            self.char_labels = []
            for char in self.button_text:
                if not self.winfo_exists():
                    break
                    
                label = tk.Label(
                    self.text_frame, 
                    text=char,
                    font=self.cget('font'),
                    fg=self.normal_fg,
                    bg=self.cget('bg'),
                    padx=0,
                    bd=0,
                    width=0,
                    highlightthickness=0
                )
                
                label.bind("<Button-1>", safe_invoke)
                label.bind("<ButtonRelease-1>", safe_event_generate("<ButtonRelease-1>"))
                label.bind("<Enter>", safe_event_generate("<Enter>"))
                label.bind("<Leave>", safe_event_generate("<Leave>"))
                
                label.pack(side=tk.LEFT, padx=0, ipadx=0, pady=0, ipady=0)
                self.char_labels.append(label)
            
            self.char_states = []
            for i in range(len(self.button_text)):
                phase = i * 0.3
                self.char_states.append({'phase': phase})
            
            self.text_animation_active = True
            self.text_animation_id = None
            
            self.after(50, self.animate_text)
            
        except Exception as e:
            print(f"Button text animation setup error: {str(e)}")   
            try:
                if self.winfo_exists():
                    self.config(text=self.button_text)
            except:
                pass
    
    def animate_text(self):
        try:
            if not self.text_animation_active or not self.winfo_exists():
                return
                
            if not hasattr(self, 'char_labels') or not hasattr(self, 'char_states'):
                return
            
            if hasattr(self, 'text_animation_id') and self.text_animation_id:
                try:
                    self.after_cancel(self.text_animation_id)
                except:
                    pass
            
            for i, (label, state) in enumerate(zip(self.char_labels, self.char_states)):
                try:
                    if not label.winfo_exists():
                        continue
                        
                    state['phase'] = (state['phase'] + 0.12) % (2 * 3.14159)
                    import math
                    opacity = self.min_opacity + (self.max_opacity - self.min_opacity) * ((math.sin(state['phase']) + 1) / 2)
                    
                    current_bg = self.cget('bg')
                    if current_bg.lower() == self.custom_normal_bg.lower():
                        color_value = int(50 + (205 * opacity))
                        hex_color = f"#{color_value:02x}{color_value:02x}{color_value:02x}"
                    else:
                        color_value = int(50 + (205 * opacity))
                        hex_color = f"#{color_value:02x}{color_value:02x}{color_value:02x}"
                    
                    label.config(fg=hex_color, bg=current_bg)
                    
                except Exception as label_error:
                    continue
            
            if self.text_animation_active and self.winfo_exists():
                self.text_animation_id = self.after(60, self.animate_text)
            
        except Exception as e:
            try:
                self.text_animation_active = False
                if self.winfo_exists():
                    self.config(text=self.button_text)
            except:
                pass

    def hex_to_rgb(self, color):
        color = color.lstrip('#')
        return tuple(int(color[i:i+2], 16) for i in (0, 2, 4))

    def rgb_to_hex(self, r, g, b):
        return f'#{r:02x}{g:02x}{b:02x}'

    def interpolate_color(self, start, end, progress):
        r = start[0] + (end[0] - start[0]) * progress
        g = start[1] + (end[1] - start[1]) * progress
        b = start[2] + (end[2] - start[2]) * progress
        return self.rgb_to_hex(int(r), int(g), int(b))

    def start_fade(self, from_color, to_color):
        if hasattr(self, 'fade_animation_id') and self.fade_animation_id:
            try:
                self.after_cancel(self.fade_animation_id)
            except:
                pass
            
        self.fade_running = True
        self.current_step = 0
        self.fade_from_color = from_color
        self.fade_to_color = to_color
        self.animate_fade()

    def animate_fade(self):
        try:
            if not self.winfo_exists():
                self.fade_running = False
                return
                
            if self.current_step <= self.fade_steps:
                progress = self.current_step / self.fade_steps
                eased_progress = progress * progress * (3.0 - 2.0 * progress)
                
                color = self.interpolate_color(self.fade_from_color, self.fade_to_color, eased_progress)
                self.config(bg=color)
                
                if hasattr(self, 'text_frame') and self.text_frame.winfo_exists():
                    self.text_frame.config(bg=color)
                    
                self.current_step += 1
                self.fade_animation_id = self.after(self.fade_speed, self.animate_fade)
            else:
                self.fade_running = False
                final_color = self.rgb_to_hex(*self.fade_to_color)
                self.config(bg=final_color)
                
                if hasattr(self, 'text_frame') and self.text_frame.winfo_exists():
                    self.text_frame.config(bg=final_color)
                    
                self.fade_animation_id = None
        except Exception as e:
            self.fade_running = False
            self.fade_animation_id = None
                
    def set_colors(self, normal_bg=None, hover_bg=None, text=None):
        if normal_bg:
            self.custom_normal_bg = normal_bg
            self.config(bg=normal_bg)
        if hover_bg:
            self.custom_hover_bg = hover_bg
        if text:
            self.button_text = text
            if not self.use_text_animation:
                self.config(text=text)
            else:
                if hasattr(self, 'text_frame') and self.text_frame.winfo_exists():
                    for label in self.char_labels:
                        label.destroy()
                    self.setup_text_animation()




# ===================== PARTÄ°KÃœL OPTÄ°MÄ°ZASYONU =====================
class Particle:
    
    def __init__(self, canvas, x, y):
        self.canvas = canvas
        self.r = random.uniform(1.5, 3.5)
        self.speed = 0.5 + (4 - self.r) * 0.3
        self.drift = random.uniform(-0.3, 0.3)

        self.x = x
        self.y = y

        color = random.choice(["#303030", "#F5F5F5", "#505050", "#606060", "#707070"])
        self.id = canvas.create_oval(
            x - self.r, y - self.r, 
            x + self.r, y + self.r, 
            fill=color, outline=""
        )

    def update(self, height):
        self.y += self.speed
        self.x += self.drift

        if (
            self.y - self.r > height
            or self.x < 0
            or self.x > self.canvas.winfo_width()
        ):
            self.y = -self.r
            self.x = random.randint(0, self.canvas.winfo_width())

        self.canvas.coords(
            self.id,
            self.x - self.r, self.y - self.r,
            self.x + self.r, self.y + self.r
        )




