    def _animate_box_outline(self, canvas, box_elements):
        try:
            if not box_elements:
                return
                
            if not canvas or not hasattr(canvas, 'winfo_exists') or not canvas.winfo_exists():
                return
                
            current = box_elements.get('current_outline', "#F5F5F5")
            target = box_elements.get('target_outline', "#FFFFFF")
            
            print(f"Current: {current}, Target: {target}")
            
            if not (current.startswith('#') and len(current) == 7 and target.startswith('#') and len(target) == 7):
                box_elements['animation_active'] = False
                return
                
            if current == target:
                box_elements['animation_active'] = False
                return
                
            try:
                current_r = int(current[1:3], 16)
                current_g = int(current[3:5], 16)
                current_b = int(current[5:7], 16)
                
                target_r = int(target[1:3], 16)
                target_g = int(target[3:5], 16)
                target_b = int(target[5:7], 16)
                
                step = 0.15
                new_r = int(current_r + (target_r - current_r) * step)
                new_g = int(current_g + (target_g - current_g) * step)
                new_b = int(current_b + (target_b - current_b) * step)
                
                new_r = max(0, min(255, new_r))
                new_g = max(0, min(255, new_g))
                new_b = max(0, min(255, new_b))

                new_color = f"#{new_r:02x}{new_g:02x}{new_b:02x}"
                box_elements['current_outline'] = new_color
                
                canvas.itemconfig(box_elements['border'], fill=new_color)
                canvas.itemconfig(box_elements['inner'], outline=new_color)
            except ValueError as ve:
                print(f"Color conversion error: {ve}")
                box_elements['animation_active'] = False
                return
                
            canvas.after(20, lambda: self._animate_box_outline(canvas, box_elements))
        except Exception as e:
            print(f"Box animation error: {str(e)}")
            box_elements['animation_active'] = False
    
    def hsv_to_rgb(self, h, s, v):
        if s == 0.0:
            return v, v, v
            
        i = int(h * 6)
        f = (h * 6) - i
        p = v * (1 - s)
        q = v * (1 - s * f)
        t = v * (1 - s * (1 - f))
        i = i % 6
        
        if i == 0:
            return v, t, p
        elif i == 1:
            return q, v, p
        elif i == 2:
            return p, v, t
        elif i == 3:
            return p, q, v
        elif i == 4:
            return t, p, v
        else:
            return v, p, q
            
    def animate_main_title(self, text, parent_frame, font_family, font_size, font_style, text_color="white"):
        try:
            char_labels = []
            for char in text:
                label = tk.Label(
                    parent_frame, 
                    text=char,
                    font=(font_family, font_size, font_style), 
                    fg=text_color,
                    bg="#1A1A1A",
                    padx=0,
                    bd=0,
                    width=0,
                    highlightthickness=0
                )
                label.pack(side=tk.LEFT, padx=0, ipadx=0, pady=0, ipady=0)
                char_labels.append(label)
            
            char_states = []
            for i in range(len(text)):
                phase = i * 0.3
                char_states.append({'phase': phase})
            
            def animate():
                try:
                    if not hasattr(parent_frame, 'winfo_exists') or not parent_frame.winfo_exists():
                        return
                    
                    valid_labels = []
                    for i, (label, state) in enumerate(zip(char_labels, char_states)):
                        try:
                            if hasattr(label, 'winfo_exists') and label.winfo_exists():
                                valid_labels.append((label, state))
                                
                                state['phase'] = (state['phase'] + 0.15) % (2 * math.pi)
                                opacity = 0.3 + 0.7 * ((math.sin(state['phase']) + 1) / 2)
                                
                                color_value = int(50 + (205 * opacity))
                                hex_color = f"#{color_value:02x}{color_value:02x}{color_value:02x}"
                                
                                if text_color != "white":
                                   
                                    r = int(text_color[1:3], 16)
                                    g = int(text_color[3:5], 16)
                                    b = int(text_color[5:7], 16)
                                    
                                    
                                    r = int(r * opacity)
                                    g = int(g * opacity)
                                    b = int(b * opacity)
                                    
                                    hex_color = f"#{r:02x}{g:02x}{b:02x}"
                                
                                
                                label.config(fg=hex_color)
                        except:
                            continue
                    
                    
                    if not valid_labels:
                        return
                    
                    
                    try:
                        if parent_frame.winfo_exists():
                            parent_frame.after(50, animate)
                    except:
                        pass
                except Exception as e:
                    print(f"Slogan animation error: {str(e)}")
            
            
            animate()
            
        except Exception as e:
            print(f"Main title setup error: {str(e)}")
            
