    def animate_slogan_text(self):
        try:
           
            if not self or not hasattr(self, '__class__'):
                return
            
            
            try:
                if not self.winfo_exists():
                    return
            except:
                return
            
            
            if not hasattr(self, 'current_screen'):
                return
                
            try:
                if not self.current_screen or not self.current_screen.winfo_exists():
                    return
            except:
                return
                
            
            if not hasattr(self, 'slogan_text') or not self.slogan_text:
                return
                
            
            if not hasattr(self, 'char_labels') or not self.char_labels:
                try:
                    
                    if hasattr(self, 'slogan_label'):
                        try:
                            if self.slogan_label and self.slogan_label.winfo_exists():
                                self.slogan_label.destroy()
                        except:
                            pass
                    
                    
                    bg_color = "#1A1A1A"  # Default
                    if hasattr(self, 'COLORS') and 'bg' in self.COLORS:
                        bg_color = self.COLORS["bg"]
                    elif 'COLORS' in globals() and 'bg' in COLORS:
                        bg_color = COLORS["bg"]
                    
                    
                    self.slogan_frame = tk.Frame(self.current_screen, bg=bg_color)
                    self.slogan_frame.grid(row=1, column=0, pady=(0, 5))
                    
                    
                    self.char_labels = []
                    for char in self.slogan_text:
                        label = tk.Label(
                            self.slogan_frame, 
                            text=char,
                            font=("Copperplate Gothic", 16, "italic"), 
                            fg="#FFFFFF",
                            bg=bg_color,
                            width=1
                        )
                        label.pack(side=tk.LEFT, padx=1)
                        self.char_labels.append(label)
                    
                    
                    self.char_states = []
                    for i in range(len(self.slogan_text)):
                        phase = i * 0.3
                        self.char_states.append({'phase': phase})
                    
                    self.min_opacity = 0.1
                    self.max_opacity = 1.0
                    
                    print(f"Created {len(self.char_labels)} character labels for animation")
                except Exception as setup_error:
                    print(f"Slogan setup error: {setup_error}")
                    return
            
            
            try:
                valid_labels = []
                if hasattr(self, 'char_labels') and hasattr(self, 'char_states'):
                    for i, (label, state) in enumerate(zip(self.char_labels, self.char_states)):
                        try:
                            if label and hasattr(label, 'winfo_exists') and label.winfo_exists():
                                valid_labels.append((label, state))
                                
                                state['phase'] = (state['phase'] + 0.15) % (2 * 3.14159)
                                opacity = self.min_opacity + (self.max_opacity - self.min_opacity) * ((math.sin(state['phase']) + 1) / 2)
                                color_value = int(50 + (205 * opacity))
                                hex_color = f"#{color_value:02x}{color_value:02x}{color_value:02x}"
                                
                                label.config(fg=hex_color)
                        except:
                            continue
                
                
                if not valid_labels:
                    return
                    
            except Exception as update_error:
                print(f"Slogan update error: {update_error}")
                return
            try:
                if self and hasattr(self, 'winfo_exists') and self.winfo_exists():
                    self.after(50, self.safe_animate_slogan_text)
            except:
                pass
                
        except Exception as e:
            pass

