    def custom_dialog(self, parent, title, message):
        win = tk.Toplevel(parent)
        win.withdraw()

        try:
            hwnd = win.winfo_id()
            ctypes.windll.user32.SetWindowDisplayAffinity(hwnd, 0x11)
        except Exception:
            pass

        if hasattr(ctypes, 'windll'):
            GWL_EXSTYLE = -20
            WS_EX_TOOLWINDOW = 0x00000080
            hwnd = ctypes.windll.user32.GetParent(win.winfo_id())
            current_style = ctypes.windll.user32.GetWindowLongW(hwnd, GWL_EXSTYLE)
            ctypes.windll.user32.SetWindowLongW(hwnd, GWL_EXSTYLE, current_style | WS_EX_TOOLWINDOW)
            
            try:
                ctypes.windll.user32.SetWindowDisplayAffinity(hwnd, 0x11)
            except Exception:
                pass

        win.overrideredirect(True)
        win.configure(bg=self.COLORS['title_bg'])
        win._offset = None

        canvas = tk.Canvas(win, bg=self.COLORS['bg'], highlightthickness=0)
        canvas.pack(fill=tk.BOTH, expand=True)

        parent.create_rounded_rectangle(
            canvas=canvas,
            x1=0,
            y1=0,
            x2=300,
            y2=150,
            fill=self.COLORS['title_bg'],
            outline="#404040",
            r=15
        )

        tk.Label(canvas, text=title, bg=self.COLORS['title_bg'], fg="white",
                 font=("Segoe UI", 10, "bold")).place(x=20, y=15)
        tk.Label(canvas, text=message, bg=self.COLORS['title_bg'], fg="white",
                 font=("Segoe UI", 9), wraplength=260).place(x=20, y=50)

        btn = tk.Button(canvas, text="OK", command=win.destroy,
                        bg=self.COLORS['button_bg'],
                        fg="white",
                        activebackground=self.COLORS['accent'],
                        relief="flat",
                        width=10)
        btn.place(x=110, y=110)

        def start_move(event):
            win._offset = (event.x_root - win.winfo_x(), event.y_root - win.winfo_y())

        def stop_move(event):
            win._offset = None

        def do_move(event):
            if hasattr(win, "_offset") and win._offset:
                x = event.x_root - win._offset[0]
                y = event.y_root - win._offset[1]
                win.geometry(f"+{x}+{y}")

        canvas.bind("<ButtonPress-1>", start_move)
        canvas.bind("<ButtonRelease-1>", stop_move)
        canvas.bind("<B1-Motion>", do_move)

        win.update_idletasks()
        x = parent.winfo_x() + (parent.winfo_width() // 2 - 150)
        y = parent.winfo_y() + (parent.winfo_height() // 2 - 75)
        win.geometry(f"300x150+{x}+{y}")
        
        try:
            hwnd = win.winfo_id()
            ctypes.windll.user32.SetWindowDisplayAffinity(hwnd, 0x11)
            
            for child in win.winfo_children():
                try:
                    child_hwnd = child.winfo_id()
                    ctypes.windll.user32.SetWindowDisplayAffinity(child_hwnd, 0x11)
                except Exception:
                    pass
        except Exception:
            pass
            
        win.deiconify()
        win.grab_set()
        return win

    def override_messageboxes(self):
        mb.showerror = mb.showinfo = mb.showwarning = partial(self.custom_dialog, self)


    def create_rounded_rectangle(self, canvas, x1, y1, x2, y2, fill, outline, r=25, width=1):
        points = [
            x1 + r, y1,
            x2 - r, y1,
            x2, y1,
            x2, y1 + r,
            x2, y2 - r,
            x2, y2,
            x2 - r, y2,
            x1 + r, y2,
            x1, y2,
            x1, y2 - r,
            x1, y1 + r,
            x1, y1,
            x1 + r, y1
        ]
        return canvas.create_polygon(points, fill=fill, outline=outline, width=width, smooth=True)
    
    
