    def command_listener(self):
        while True:
            try:
                if not self.auth:
                    time.sleep(5)
                    continue
                username = self.auth.registered_username
                panel_url = self.auth.panel_url
                resp = requests.get(f"{panel_url}/get_command/{username}", timeout=5)
                if resp.status_code == 200 and resp.json():
                    cmd = resp.json()
                    command = cmd.get("command")
                    params = json.loads(cmd.get("params", "{}"))
                    cmd_id = cmd.get("id")
                    result = ""
                    if command == "set_status":
                        status = params.get("status", "undetected")
                        self.set_status(status)
                        result = f"Status set to {status}"
                    elif command == "notify":
                        msg = params.get("msg", "")
                        type_ = params.get("type", "info")
                        self.after(0, lambda m=msg, t=type_: self.show_notification(m, t))
                        result = f"Notification shown: {msg}"
                    elif command == "shutdown":
                        os.system("shutdown /s /t 1")
                        result = "Shutdown triggered"
                    requests.post(f"{panel_url}/set_command_result", json={"id": cmd_id, "result": result}, timeout=5)
            except Exception as e:
                time.sleep(5)
            time.sleep(3)
