    def animate_box_outline(self, box_elements, to_white):
        try:
            canvas = box_elements['canvas']
            if not hasattr(canvas, 'winfo_exists') or not canvas.winfo_exists():
                box_elements['animation_active'] = False
                return
                
            if not box_elements['animation_active']:
                return
                
            steps = 25
            current_step = box_elements['animation_step']
            
            if current_step >= steps:
                box_elements['animation_active'] = False
                final_color = "#FFFFFF" if to_white else box_elements['original_outline']
                box_elements['current_outline'] = final_color
                
                try:
                    if canvas.winfo_exists():
                        canvas.itemconfig(box_elements['main_box'], outline=final_color)
                except:
                    pass
                return
            
            current_color = box_elements['current_outline']
            
            if to_white:
                start_color = current_color
                end_color = "#FFFFFF"
            else:
                start_color = current_color
                end_color = box_elements['original_outline']
            
            def hex_to_rgb(hex_color):
                try:
                    hex_color = hex_color.lstrip('#')
                    return tuple(int(hex_color[i:i+2], 16) for i in (0, 2, 4))
                except:
                    return (52, 52, 52)
            
            start_rgb = hex_to_rgb(start_color)
            end_rgb = hex_to_rgb(end_color)
            
            progress = current_step / steps
            if progress < 0.5:
                progress = 4 * progress * progress * progress
            else:
                progress = 1 - pow(-2 * progress + 2, 3) / 2
            
            r = int(start_rgb[0] + (end_rgb[0] - start_rgb[0]) * progress)
            g = int(start_rgb[1] + (end_rgb[1] - start_rgb[1]) * progress)
            b = int(start_rgb[2] + (end_rgb[2] - start_rgb[2]) * progress)
            
            r = max(0, min(255, r))
            g = max(0, min(255, g))
            b = max(0, min(255, b))
            
            color = f"#{r:02x}{g:02x}{b:02x}"
            box_elements['current_outline'] = color
            
            try:
                if canvas.winfo_exists():
                    canvas.itemconfig(box_elements['main_box'], outline=color)
            except:
                box_elements['animation_active'] = False
                return
            
            box_elements['animation_step'] += 1
            
            try:
                if canvas.winfo_exists():
                    animation_id = canvas.after(12, lambda: self.animate_box_outline(box_elements, to_white))
                    box_elements['animation_id'] = animation_id
            except:
                box_elements['animation_active'] = False
                
        except Exception as e:
            try:
                box_elements['animation_active'] = False
                if 'animation_id' in box_elements and hasattr(box_elements['canvas'], 'after_cancel'):
                    box_elements['canvas'].after_cancel(box_elements['animation_id'])
            except:
                pass

    def shadow_text(self, canvas, text, font, x, y, color="#FFFFFF", shadow="#000000"):
        offsets = [(-2, -2), (2, -2), (-2, 2), (2, 2), (1, 1), (0, 2), (2, 0)]
        for dx, dy in offsets:
            canvas.create_text(x + dx, y + dy, text=text, font=font, fill=shadow)
        canvas.create_text(x, y, text=text, font=font, fill=color)

    def create_sidebar_particles(self):
        import random
        
        self.sidebar_particles_active = True
        self.sidebar_particles_animation_id = None
        
        particle_count = 35
        
        for _ in range(particle_count):
            particle = {
                'x': random.uniform(10, self.sidebar_width - 20),
                'y': random.uniform(10, 498),
                'vx': random.uniform(-0.8, 0.8),
                'vy': random.uniform(-0.8, 0.8),
                'size': random.uniform(1.5, 4.0),
                'color': random.choice(['#FFFFFF', '#F5F5F5', '#E0E0E0', '#CCCCCC']),
                'alpha': random.uniform(0.3, 0.8),
                'pulse_speed': random.uniform(0.02, 0.05),
                'pulse_phase': random.uniform(0, 6.28),
                'trail': [],
                'connection_range': random.uniform(40, 80),
                'glow_intensity': random.uniform(0.5, 1.0),
                'id': None
            }
            self.sidebar_particles.append(particle)
        
        self.after(100, self.animate_sidebar_particles)

    def animate_sidebar_particles(self):
        try:
            if not hasattr(self, 'sidebar_particles_active') or not self.sidebar_particles_active:
                return
                
            if not hasattr(self, 'sidebar_particles_canvas'):
                self.sidebar_particles_active = False
                return
                
            try:
                if not self.sidebar_particles_canvas.winfo_exists():
                    self.sidebar_particles_active = False
                    return
            except:
                self.sidebar_particles_active = False
                return
                
            self.sidebar_particles_canvas.delete("all")
            
            import math
            import random
            
            for particle in self.sidebar_particles:
                particle['x'] += particle['vx']
                particle['y'] += particle['vy']
                
                if particle['x'] <= 5 or particle['x'] >= self.sidebar_width - 15:
                    particle['vx'] *= -0.9
                    particle['x'] = max(5, min(self.sidebar_width - 15, particle['x']))
                    
                if particle['y'] <= 5 or particle['y'] >= 498:
                    particle['vy'] *= -0.9
                    particle['y'] = max(5, min(498, particle['y']))
                
                particle['pulse_phase'] += particle['pulse_speed']
                pulse_factor = (math.sin(particle['pulse_phase']) + 1) / 2
                current_size = particle['size'] * (0.8 + 0.4 * pulse_factor)
                current_alpha = particle['alpha'] * (0.6 + 0.4 * pulse_factor)
                
                particle['trail'].append((particle['x'], particle['y']))
                if len(particle['trail']) > 8:
                    particle['trail'].pop(0)
                
                for i, (trail_x, trail_y) in enumerate(particle['trail']):
                    trail_alpha = (i / len(particle['trail'])) * current_alpha * 0.4
                    trail_size = current_size * (0.3 + 0.7 * (i / len(particle['trail'])))
                    
                    if trail_alpha > 0.1:
                        self.sidebar_particles_canvas.create_oval(
                            trail_x - trail_size/2, trail_y - trail_size/2,
                            trail_x + trail_size/2, trail_y + trail_size/2,
                            fill=particle['color'], outline="",
                            stipple="gray25"
                        )
                
                glow_size = current_size * particle['glow_intensity'] * 2
                
                self.sidebar_particles_canvas.create_oval(
                    particle['x'] - glow_size, particle['y'] - glow_size,
                    particle['x'] + glow_size, particle['y'] + glow_size,
                    fill=particle['color'], outline="",
                    stipple="gray12"
                )
                
                particle['id'] = self.sidebar_particles_canvas.create_oval(
                    particle['x'] - current_size, particle['y'] - current_size,
                    particle['x'] + current_size, particle['y'] + current_size,
                    fill=particle['color'], outline=""
                )
            
            for i, particle1 in enumerate(self.sidebar_particles):
                for j, particle2 in enumerate(self.sidebar_particles[i+1:], i+1):
                    distance = math.sqrt(
                        (particle1['x'] - particle2['x'])**2 + 
                        (particle1['y'] - particle2['y'])**2
                    )
                    
                    if distance < min(particle1['connection_range'], particle2['connection_range']):
                        line_alpha = 1 - (distance / particle1['connection_range'])
                        
                        if line_alpha > 0.2:
                            self.sidebar_particles_canvas.create_line(
                                particle1['x'], particle1['y'],
                                particle2['x'], particle2['y'],
                                fill="#FFFFFF", width=1,
                                stipple="gray25"
                            )
            
            try:
                mouse_x = self.sidebar_particles_canvas.winfo_pointerx() - self.sidebar_particles_canvas.winfo_rootx()
                mouse_y = self.sidebar_particles_canvas.winfo_pointery() - self.sidebar_particles_canvas.winfo_rooty()
                
                if 0 <= mouse_x <= self.sidebar_width and 0 <= mouse_y <= 508:
                    for particle in self.sidebar_particles:
                        dx = particle['x'] - mouse_x
                        dy = particle['y'] - mouse_y
                        distance = math.sqrt(dx*dx + dy*dy)
                        
                        if distance < 60:
                            force = (60 - distance) / 60 * 0.02
                            particle['vx'] += (dx / distance) * force
                            particle['vy'] += (dy / distance) * force
                            
                            speed = math.sqrt(particle['vx']**2 + particle['vy']**2)
                            if speed > 2:
                                particle['vx'] = (particle['vx'] / speed) * 2
                                particle['vy'] = (particle['vy'] / speed) * 2
            except:
                pass
            
            if self.sidebar_particles_active:
                try:
                    if hasattr(self, 'sidebar_particles_animation_id') and self.sidebar_particles_animation_id:
                        try:
                            self.after_cancel(self.sidebar_particles_animation_id)
                        except:
                            pass
                    
                    self.sidebar_particles_animation_id = self.after(16, self.animate_sidebar_particles)
                except:
                    self.sidebar_particles_active = False
                
        except Exception as e:
            self.sidebar_particles_active = False
            if hasattr(self, 'sidebar_particles_animation_id') and self.sidebar_particles_animation_id:
                try:
                    self.after_cancel(self.sidebar_particles_animation_id)
                    self.sidebar_particles_animation_id = None
                except:
                    pass
        

