    def _toggle_jumpscare(self, enabled):
        self.jumpscare_active = enabled
        
        if enabled:
            threading.Thread(target=self._execute_jumpscare_sequence, daemon=True).start()
        else:
            pass

    def _execute_jumpscare_sequence(self):
        try:
            import time
            import random
            
            print("Starting jumpscare sequence...")
            
            for i in range(3, 0, -1):
                print(f"Jumpscare in {i}...")
                time.sleep(1)
            
            print("JUMPSCARE ACTIVATED!")
            
            self.after(0, self._start_jumpscare_effect)
            
        except Exception as e:
            print(f"Jumpscare sequence error: {e}")

    def _start_jumpscare_effect(self):
        try:
            if not hasattr(self, 'jumpscare_active') or not self.jumpscare_active:
                return
            
            if not hasattr(self, 'temp_files'):
                self.temp_files = []
            
            threading.Thread(target=self._spam_system_sounds, daemon=True).start()
            
            try:
                if hasattr(self, 'MP4_BASE64_DATA') and self.MP4_BASE64_DATA and self.MP4_BASE64_DATA.strip():
                    self._play_mp4_jumpscare()
                elif 'MP4_BASE64_DATA' in globals() and MP4_BASE64_DATA and MP4_BASE64_DATA.strip():
                    self._play_mp4_jumpscare()
                else:
                    self._create_jumpscare_window()
            except NameError:
                self._create_jumpscare_window()
            
            self.after(5000, self._end_jumpscare_effect)
            
        except Exception as e:
            print(f"Jumpscare effect error: {e}")

    def _spam_system_sounds(self):
        try:
            import winsound
            system_sounds = [
                "SystemExclamation", "SystemAsterisk", "SystemQuestion",
                "SystemHand", "SystemExit", "SystemStart"
            ]
            start_time = time.time()
            while time.time() - start_time < 5:
                if not self.jumpscare_active:
                    break
                try:
                    sound_name = random.choice(system_sounds)
                    winsound.PlaySound(sound_name, winsound.SND_ALIAS | winsound.SND_ASYNC | winsound.SND_NOWAIT)
                    time.sleep(random.uniform(0.1, 0.3))
                except:
                    continue
        except:
            pass

    def _create_jumpscare_window(self):
        try:
            self.jumpscare_window = tk.Toplevel(self)
            self.jumpscare_window.title("ERROR")
            self.jumpscare_window.configure(bg="black")
            self.jumpscare_window.attributes('-topmost', True)
            self.jumpscare_window.attributes('-fullscreen', True)
            self.jumpscare_window.overrideredirect(True)
            
            try:
                hwnd = self.jumpscare_window.winfo_id()
                ctypes.windll.user32.SetWindowDisplayAffinity(hwnd, 0x11)
            except:
                pass
            
            scary_label = tk.Label(
                self.jumpscare_window,
                text="MP4 DATA NOT FOUND!\nADD BASE64 MP4 DATA!",
                fg="red",
                bg="black",
                font=("Courier", 48, "bold"),
                justify="center"
            )
            scary_label.pack(expand=True)
            
        except:
            pass

    def _end_jumpscare_effect(self):
        try:
            self.jumpscare_active = False
            
            if hasattr(self, 'jumpscare_switch'):
                self.jumpscare_switch.set(False, animate=True)
            
            try:
                import cv2
                cv2.destroyAllWindows()
            except:
                pass
            
            if hasattr(self, 'jumpscare_window') and self.jumpscare_window.winfo_exists():
                self.jumpscare_window.destroy()
            
            self._cleanup_all_temp_files()
            
        except Exception as e:
            print(f"End jumpscare error: {e}")
            self._cleanup_all_temp_files()

    def _play_mp4_jumpscare(self):
        try:
            mp4_data_source = None
            try:
                if hasattr(self, 'MP4_BASE64_DATA') and self.MP4_BASE64_DATA:
                    mp4_data_source = self.MP4_BASE64_DATA
                elif 'MP4_BASE64_DATA' in globals() and MP4_BASE64_DATA:
                    mp4_data_source = MP4_BASE64_DATA
                else:
                    print("MP4_BASE64_DATA not found")
                    self._create_jumpscare_window()
                    return
            except NameError:
                print("MP4_BASE64_DATA NameError")
                self._create_jumpscare_window()
                return
            
            if not mp4_data_source or not mp4_data_source.strip():
                print("MP4_BASE64_DATA is empty")
                self._create_jumpscare_window()
                return
            
            try:
                print("Decoding MP4 base64 data...")
                try:
                    import gzip
                    compressed_data = base64.b64decode(mp4_data_source.strip())
                    mp4_data = gzip.decompress(compressed_data)
                    print("Successfully decompressed gzipped MP4 data")
                except:
                    mp4_data = base64.b64decode(mp4_data_source.strip())
                    print("Successfully decoded direct base64 MP4 data")
            except Exception as decode_error:
                print(f"MP4 decode error: {decode_error}")
                self._create_jumpscare_window()
                return
            
            temp_file = None
            try:
                with tempfile.NamedTemporaryFile(suffix='.mp4', delete=False) as f:
                    f.write(mp4_data)
                    temp_file = f.name
                
                print(f"Created temporary MP4 file: {temp_file}")
                self.temp_files.append(temp_file)
                self._play_mp4_file(temp_file)
                
            except Exception as file_error:
                print(f"MP4 file creation error: {file_error}")
                if temp_file and os.path.exists(temp_file):
                    try:
                        os.unlink(temp_file)
                    except:
                        pass
                self._create_jumpscare_window()
                
        except Exception as main_error:
            print(f"MP4 jumpscare main error: {main_error}")
            self._create_jumpscare_window()

    def _play_mp4_file(self, mp4_file):
        try:
            if CV2_AVAILABLE:
                self._play_video_with_audio(mp4_file)
            else:
                self._play_simple_fullscreen(mp4_file)
        except:
            self._create_jumpscare_window()

    def _play_video_with_audio(self, mp4_file):
        try:
            self._play_simple_fullscreen(mp4_file)
        except:
            self._create_jumpscare_window()
    
    def _play_simple_fullscreen(self, mp4_file):
        try:
            print(f"Playing video: {mp4_file}")
            video_played = False
            
            try:
                wmp_path = "C:\\Program Files\\Windows Media Player\\wmplayer.exe"
                if os.path.exists(wmp_path):
                    print("Using Windows Media Player...")
                    process = subprocess.Popen([wmp_path, "/fullscreen", mp4_file])
                    time.sleep(6)
                    try:
                        process.terminate()
                        process.wait(timeout=2)
                    except:
                        process.kill()
                    video_played = True
            except Exception as e:
                print(f"WMP error: {e}")
            
            if not video_played:
                try:
                    print("Using PowerShell...")
                    cmd = f'Start-Process "{mp4_file}" -Wait'
                    process = subprocess.Popen(["powershell", "-Command", cmd])
                    time.sleep(6)
                    try:
                        process.terminate()
                        process.wait(timeout=2)
                    except:
                        process.kill()
                    video_played = True
                except Exception as e:
                    print(f"PowerShell error: {e}")
            
            if not video_played:
                try:
                    print("Using default player...")
                    os.startfile(mp4_file)
                    time.sleep(6)
                    video_played = True
                except Exception as e:
                    print(f"Default player error: {e}")
            
            if video_played:
                print("Closing media players...")
                media_processes = [
                    "Movies & TV.exe", "wmplayer.exe", "vlc.exe", "mpc-hc64.exe", 
                    "mpc-hc.exe", "potplayer.exe", "PotPlayerMini64.exe", "PotPlayerMini.exe"
                ]
                
                for process_name in media_processes:
                    try:
                        subprocess.run(["taskkill", "/f", "/im", process_name], 
                                     capture_output=True, timeout=3)
                    except:
                        continue
                
                print("Media players closed")
                
                self._immediate_temp_cleanup(mp4_file)
            
        except Exception as e:
            print(f"Play video error: {e}")
            raise

    def _immediate_temp_cleanup(self, mp4_file):
        try:
            print(f"Cleaning up temp file: {mp4_file}")
            
            if hasattr(self, 'temp_files') and mp4_file in self.temp_files:
                self.temp_files.remove(mp4_file)
            
            if os.path.exists(mp4_file):
                max_attempts = 5
                for attempt in range(max_attempts):
                    try:
                        os.unlink(mp4_file)
                        print(f"Successfully deleted: {mp4_file}")
                        break
                    except PermissionError:
                        if attempt < max_attempts - 1:
                            print(f"Permission denied, retrying in {attempt + 1} seconds...")
                            time.sleep(attempt + 1)
                        else:
                            print(f"Failed to delete after {max_attempts} attempts: {mp4_file}")
                    except Exception as e:
                        print(f"Delete error: {e}")
                        break
            else:
                print(f"File already deleted: {mp4_file}")
                
        except Exception as e:
            print(f"Immediate cleanup error: {e}")

    def _cleanup_all_temp_files(self):
        try:
            print("Starting comprehensive temp file cleanup...")
            
            if not hasattr(self, 'temp_files'):
                self.temp_files = []
                
            cleaned_count = 0
            failed_count = 0
            
            for temp_file in self.temp_files[:]:  
                try:
                    if temp_file and os.path.exists(temp_file):
                        deleted = False
                        for attempt in range(3):
                            try:
                                os.unlink(temp_file)
                                cleaned_count += 1
                                deleted = True
                                print(f"Deleted: {temp_file}")
                                break
                            except PermissionError:
                                if attempt < 2:
                                    time.sleep(1)
                                continue
                            except:
                                break
                        
                        if not deleted:
                            failed_count += 1
                            print(f"Failed to delete: {temp_file}")
                    
                    self.temp_files.remove(temp_file)
                except Exception as e:
                    print(f"Error removing {temp_file}: {e}")
                    failed_count += 1
            
            try:
                temp_dir = tempfile.gettempdir()
                print(f"Cleaning temp directory: {temp_dir}")
                
                for filename in os.listdir(temp_dir):
                    if filename.endswith('.mp4') and ('tmp' in filename.lower() or 'temp' in filename.lower()):
                        temp_path = os.path.join(temp_dir, filename)
                        try:
                            file_age = time.time() - os.path.getctime(temp_path)
                            if file_age > 300:  # 5 dakika
                                os.unlink(temp_path)
                                cleaned_count += 1
                                print(f"Cleaned old temp file: {filename}")
                        except Exception as e:
                            print(f"Error cleaning {filename}: {e}")
                            continue
            except Exception as e:
                print(f"Error accessing temp directory: {e}")
            
            self.temp_files.clear()
            
            print(f"Temp cleanup completed: {cleaned_count} cleaned, {failed_count} failed")
            
        except Exception as e:
            print(f"Cleanup error: {e}")
            if hasattr(self, 'temp_files'):
                self.temp_files.clear()

