    def panic_action(self):
        import ctypes
        
        try:
            hwnd = ctypes.windll.user32.GetForegroundWindow()
            if hwnd:
                ctypes.windll.user32.SetWindowDisplayAffinity(hwnd, 0x11)
        except:
            pass
        
        MB_YESNO = 0x4
        MB_ICONWARNING = 0x30
        MB_TOPMOST = 0x00001000

        result = self._show_streamproof_messagebox(
            "This operation will cause a Blue Screen of Death!\n\nAre you sure you want to continue?",
            "PANIC MODE - WARNING",
            MB_YESNO | MB_ICONWARNING | MB_TOPMOST
        )
        
        if result == 6:
            final_result = self._show_streamproof_messagebox(
                "FINAL WARNING!\n\nThis operation is IRREVERSIBLE!\nSystem will restart immediately!\n\nProceed?",
                "PANIC MODE - FINAL WARNING",
                MB_YESNO | MB_ICONWARNING | MB_TOPMOST
            )
            
            if final_result == 6:
                self.show_notification("Panic mode activated! System will BSOD in 3 seconds...", "info")
                threading.Thread(target=self._execute_panic_bsod, daemon=True).start()
        else:
            self.show_notification("Panic mode cancelled.", "info")

    def _show_streamproof_messagebox(self, message, title, flags):
        import ctypes
        
        try:
            result = ctypes.windll.user32.MessageBoxW(0, message, title, flags)
            
            try:
                hwnd = ctypes.windll.user32.GetForegroundWindow()
                if hwnd:
                    ctypes.windll.user32.SetWindowDisplayAffinity(hwnd, 0x11)
                    
                    ctypes.windll.user32.SetWindowDisplayAffinity(hwnd, 0x00000011)  # WDA_EXCLUDEFROMCAPTURE
            except:
                pass
                
            return result
            
        except Exception:
            return ctypes.windll.user32.MessageBoxW(0, message, title, flags)

