    def on_closing(self):
        try:
            if hasattr(self, 'keyboard_hook_active'):
                self.keyboard_hook_active = False
            
            if hasattr(self, 'sidebar_animation_active'):
                self.sidebar_animation_active = False
            self.cleanup_sidebar_animations()
            
            if hasattr(self, 'loading_animation_id') and self.loading_animation_id:
                try:
                    self.after_cancel(self.loading_animation_id)
                except:
                    pass
            
            for attr_name in dir(self):
                try:
                    attr = getattr(self, attr_name)
                    if hasattr(attr, 'text_animation_active'):
                        attr.text_animation_active = False
                    if hasattr(attr, 'fade_running'):
                        attr.fade_running = False
                    if hasattr(attr, 'fade_animation_id') and attr.fade_animation_id:
                        try:
                            self.after_cancel(attr.fade_animation_id)
                        except:
                            pass
                except:
                    continue
            
            if hasattr(self, 'content') and self.content.winfo_exists():
                try:
                    children = list(self.content.winfo_children())
                    for widget in children:
                        try:
                            if widget.winfo_exists():
                                if hasattr(widget, 'text_animation_active'):
                                    widget.text_animation_active = False
                                if hasattr(widget, 'fade_running'):
                                    widget.fade_running = False
                                widget.destroy()
                        except:
                            continue
                except:
                    pass
            
            self.quit()
            
        except Exception as e:
            print(f"Closing error: {e}")
            try:
                self.quit()
            except:
                import sys
                sys.exit(0)

    def toggle_sidebar(self):
        if not hasattr(self, 'sidebar_animation_active'):
            self.sidebar_animation_active = False
            
        if self.sidebar_animation_active:
            return
            
        self.sidebar_visible = not self.sidebar_visible
        self.start_sidebar_animation()

    def start_sidebar_animation(self):
        self.sidebar_animation_active = True
        
        animation_steps = 20
        animation_duration = 300  # ms
        step_delay = animation_duration // animation_steps
        
        if self.sidebar_visible:
            start_sidebar_x = -self.sidebar_width
            target_sidebar_x = 0
            start_content_x = self.content_x_offset
            target_content_x = self.content_x_offset + self.sidebar_width
        else:
            start_sidebar_x = 0
            target_sidebar_x = -self.sidebar_width
            start_content_x = self.content_x_offset + self.sidebar_width
            target_content_x = self.content_x_offset
        
        self._animate_sidebar_step(0, animation_steps, 
                                  start_sidebar_x, target_sidebar_x,
                                  start_content_x, target_content_x, 
                                  step_delay)

    def _animate_sidebar_step(self, current_step, total_steps, start_sidebar_x, target_sidebar_x,
                             start_content_x, target_content_x, step_delay):
        if current_step >= total_steps:
            self.sidebar_animation_active = False
            self.sidebar.place(x=target_sidebar_x, y=0)
            self.content.place(x=target_content_x, y=0)
            return
        
        progress = current_step / total_steps
        if progress < 0.5:
            eased_progress = 4 * progress * progress * progress
        else:
            eased_progress = 1 - pow(-2 * progress + 2, 3) / 2
        
        current_sidebar_x = start_sidebar_x + (target_sidebar_x - start_sidebar_x) * eased_progress
        current_content_x = start_content_x + (target_content_x - start_content_x) * eased_progress
        
        self.sidebar.place(x=int(current_sidebar_x), y=0)
        self.content.place(x=int(current_content_x), y=0)
        
        self.after(step_delay, lambda: self._animate_sidebar_step(
            current_step + 1, total_steps,
            start_sidebar_x, target_sidebar_x,
            start_content_x, target_content_x, step_delay
        ))

