    def _toggle_streamproof(self, state):
        if state:
            self._force_background_redraw()
            self.enable_stream_proof()
        else:
            self.disable_stream_proof()

    def _force_background_redraw(self):
        try:
            self.bg_canvas.configure(bg=COLORS['bg'])
            for child in self.inner_frame.winfo_children():
                try:
                    child.configure(bg=COLORS['bg'])
                except Exception:
                    pass
            self.update_idletasks()
        except Exception as e:
            print(f"Background redraw error: {str(e)}")

    def enable_stream_proof(self):
        try:
            hwnd = self.winfo_id()
            ctypes.windll.user32.SetWindowDisplayAffinity(hwnd, 0x11)
        except Exception as e:
            print(f"StreamProof main window enable error: {str(e)}")
            
        try:
            parent_hwnd = ctypes.windll.user32.GetParent(self.winfo_id())
            if parent_hwnd:
                ctypes.windll.user32.SetWindowDisplayAffinity(parent_hwnd, 0x11)
        except Exception as e:
            print(f"StreamProof parent window enable error: {str(e)}")
            
        try:
            for child in self.winfo_children():
                try:
                    child_hwnd = child.winfo_id()
                    ctypes.windll.user32.SetWindowDisplayAffinity(child_hwnd, 0x11)
                    
                    if hasattr(child, "winfo_children"):
                        for subchild in child.winfo_children():
                            try:
                                subchild_hwnd = subchild.winfo_id()
                                ctypes.windll.user32.SetWindowDisplayAffinity(subchild_hwnd, 0x11)
                            except Exception:
                                pass
                except Exception:
                    pass
        except Exception as e:
            print(f"StreamProof child windows enable error: {str(e)}")

    def disable_stream_proof(self):
        self.show_stream_proof_warning()
        return
        
    def show_stream_proof_warning(self):
        import tkinter.messagebox as messagebox
        messagebox.showwarning(
            "Security Warning", 
            "Stream proof cannot be disabled for security reasons."
        )


