    def clean_specific_registry_key(self, key_path):
        
        try:
            import winreg
            
            if key_path.startswith('HKCU'):
                hive = winreg.HKEY_CURRENT_USER
                subkey = key_path.replace('HKCU\\', '')
            elif key_path.startswith('HKLM'):
                hive = winreg.HKEY_LOCAL_MACHINE  
                subkey = key_path.replace('HKLM\\', '')
            else:
                return
            
            try:
                key = winreg.OpenKey(hive, subkey, 0, winreg.KEY_ALL_ACCESS)
                
                subkeys = []
                try:
                    i = 0
                    while True:
                        subkey_name = winreg.EnumKey(key, i)
                        subkeys.append(subkey_name)
                        i += 1
                except OSError:
                    pass
                
                for subkey_name in subkeys:
                    if self.is_suspicious_registry_entry(subkey_name):
                        try:
                            winreg.DeleteKey(key, subkey_name)
                            self.debug_log(f'Suspicious registry key deleted: {subkey_name}')
                        except Exception:
                            pass
                
                winreg.CloseKey(key)
                
            except FileNotFoundError:
                pass  # Key not found
                
        except Exception as e:
            self.debug_log(f'Registry key cleanup error {key_path}: {e}')

