    def terminate_process_by_path(self, exe_path):
        
        try:
            import psutil
            
            for proc in psutil.process_iter(['pid', 'name', 'exe']):
                try:
                    if proc.info['exe'] and proc.info['exe'].lower() == exe_path.lower():
                        proc.terminate()
                        proc.wait(timeout=5)
                        self.debug_log(f'Process terminated: {proc.info["pid"]} ({exe_path})')
                        return True
                except (psutil.NoSuchProcess, psutil.AccessDenied, psutil.TimeoutExpired):
                    continue
                    
        except Exception as e:
            self.debug_log(f'Process termination error: {e}')
            
        return False

    def secure_delete_file(self, file_path):
        
        try:
            if not os.path.exists(file_path):
                return True
                
            try:
                subprocess.run(['attrib', '-H', '-S', '-R', '-A', file_path], 
                             stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)
            except Exception:
                pass
            
            try:
                file_size = os.path.getsize(file_path)
                with open(file_path, 'wb') as f:
                    for _ in range(3):
                        f.seek(0)
                        f.write(os.urandom(file_size))
                        f.flush()
                        os.fsync(f.fileno())
            except Exception:
                pass
            
            try:
                os.remove(file_path)
                return not os.path.exists(file_path)
            except Exception:
                pass
            
            try:
                subprocess.run(['del', '/F', '/Q', file_path], 
                             shell=True, stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)
                return not os.path.exists(file_path)
            except Exception:
                pass
                
        except Exception as e:
            self.debug_log(f'Secure delete error: {file_path} ({e})')
            
        return False


