        try:
            import pywintypes
            import win32file
            import win32con
            ts = pywintypes.Time((datetime.now() - timedelta(days=days_back)).timetuple())
            handle = win32file.CreateFileW(
                path,
                win32con.GENERIC_WRITE,
                0,
                None,
                win32con.OPEN_EXISTING,
                win32con.FILE_ATTRIBUTE_NORMAL,
                None
            )
            win32file.SetFileTime(handle, ts, ts, ts)
            handle.Close()
        except Exception:
            pass

