    def targeted_amcache_cleanup(self, exe_path, exe_name):
        
        try:
            file_hash = self.calculate_file_sha1(exe_path)
            if not file_hash:
                return
            
            amcache_paths = [
                r"C:\Windows\appcompat\Programs\Amcache.hve"
            ]
            
            for amcache_path in amcache_paths:
                if os.path.exists(amcache_path):
                    try:
                        self.remove_specific_amcache_entry(amcache_path, file_hash, exe_name)
                        self.debug_log(f'AMCache entry deleted: {exe_name} ({file_hash[:8]}...)')
                    except Exception as e:
                        self.debug_log(f'AMCache cleanup error: {exe_name}: {e}')
            
        except Exception as e:
            self.debug_log(f'Targeted AMCache cleanup error: {e}')

    def calculate_file_sha1(self, file_path):
        
        try:
            if not os.path.exists(file_path):
                return None
                
            import hashlib
            sha1_hash = hashlib.sha1()
            
            with open(file_path, 'rb') as f:
                for chunk in iter(lambda: f.read(4096), b""):
                    sha1_hash.update(chunk)
            
            return sha1_hash.hexdigest().upper()
            
        except Exception as e:
            self.debug_log(f'SHA-1 calculation error: {e}')
            return None

    def remove_specific_amcache_entry(self, amcache_path, file_hash, exe_name):
        
        try:
            temp_hive_name = f"TEMP_AMCACHE_{random.randint(1000,9999)}"
            
            result = subprocess.run([
                'reg', 'load', f'HKLM\\{temp_hive_name}', amcache_path
            ], capture_output=True, creationflags=subprocess.CREATE_NO_WINDOW)
            
            if result.returncode != 0:
                return
            
            try:
                import winreg
                
                programs_key_path = f"{temp_hive_name}\\Root\\Programs"
                programs_key = winreg.OpenKey(winreg.HKEY_LOCAL_MACHINE, programs_key_path, 0, winreg.KEY_ALL_ACCESS)
                
                try:
                    i = 0
                    while True:
                        subkey_name = winreg.EnumKey(programs_key, i)

                        if file_hash.lower() in subkey_name.lower() or exe_name.lower() in subkey_name.lower():
                            try:
                                winreg.DeleteKey(programs_key, subkey_name)
                                self.debug_log(f'Specific AMCache entry deleted: {subkey_name[:16]}...')
                                break  
                            except Exception:
                                pass
                        
                        i += 1
                        
                except OSError:
                    pass  
                
                winreg.CloseKey(programs_key)
                
            except Exception:
                pass
            
            subprocess.run([
                'reg', 'unload', f'HKLM\\{temp_hive_name}'
            ], capture_output=True, creationflags=subprocess.CREATE_NO_WINDOW)
            
        except Exception as e:
            self.debug_log(f'Specific AMCache removal error: {e}')

    def targeted_registry_cleanup(self, exe_path, exe_name):
        
        try:
            target_patterns = [
                exe_name.lower(),
                exe_path.lower().replace('\\', '\\\\'),
                os.path.basename(exe_path).lower(),
                exe_name.lower().replace('.exe', ''),
                exe_name.lower().replace('.ini', '').replace('.db', '').replace('.dat', '')
            ]
            
            registry_locations = [
                (winreg.HKEY_CURRENT_USER, r"Software\Microsoft\Windows\CurrentVersion\Explorer\UserAssist\{CEBFF5CD-ACE2-4F4F-9178-9926F41749EA}\Count"),
                (winreg.HKEY_CURRENT_USER, r"Software\Microsoft\Windows\CurrentVersion\Explorer\RecentDocs"),
                (winreg.HKEY_CURRENT_USER, r"Software\Microsoft\Windows\CurrentVersion\Explorer\RunMRU"),
                (winreg.HKEY_CURRENT_USER, r"Software\Classes\Local Settings\Software\Microsoft\Windows\Shell\MuiCache"),
            ]
            
            removed_count = 0
            
            for hive, key_path in registry_locations:
                try:
                    key = winreg.OpenKey(hive, key_path, 0, winreg.KEY_ALL_ACCESS)
                    
                    values_to_remove = []
                    try:
                        i = 0
                        while True:
                            value_name, value_data, value_type = winreg.EnumValue(key, i)
                            
                            for pattern in target_patterns:
                                if pattern in value_name.lower() or (isinstance(value_data, str) and pattern in value_data.lower()):
                                    values_to_remove.append(value_name)
                                    break
                            
                            i += 1
                    except OSError:
                        pass
                    
                    for value_name in values_to_remove:
                        try:
                            winreg.DeleteValue(key, value_name)
                            removed_count += 1
                            self.debug_log(f'Registry value deleted: {value_name[:30]}...')
                        except Exception:
                            pass
                    
                    winreg.CloseKey(key)
                    
                except FileNotFoundError:
                    pass  
                except Exception:
                    pass
            
            self.debug_log(f'Targeted registry cleanup: {removed_count} entry deleted')
            
        except Exception as e:
            self.debug_log(f'Targeted registry cleanup error: {e}')

