    def wait_for_service(self, service_name, timeout=10):
        for _ in range(timeout):
            try:
                status = subprocess.check_output(['sc', 'query', service_name], stderr=subprocess.DEVNULL).decode()
                if "RUNNING" in status:
                    return True
            except Exception:
                pass
            time.sleep(1)
        return False

