    def detect_user_type(self):
        """Detect user type"""
        try:
            gaming_processes = ['steam.exe', 'discord.exe', 'origin.exe', 'battle.net.exe', 'epicgameslauncher.exe']
            for proc in psutil.process_iter(['name']):
                if proc.info['name'] in gaming_processes:
                    return 'gaming'
            
            office_processes = ['outlook.exe', 'excel.exe', 'word.exe', 'powerpnt.exe', 'teams.exe']
            for proc in psutil.process_iter(['name']):
                if proc.info['name'] in office_processes:
                    return 'office'
            
            return 'normal'
        except:
            return 'normal'

    def get_system_activity(self):
        """Calculate system activity"""
        try:
            cpu_percent = psutil.cpu_percent(interval=1)
            
            disk_io = psutil.disk_io_counters()
            disk_activity = (disk_io.read_bytes + disk_io.write_bytes) / 1024 / 1024
            
            net_io = psutil.net_io_counters()
            net_activity = (net_io.bytes_sent + net_io.bytes_recv) / 1024 / 1024
            
            activity_score = min(1.0, (cpu_percent / 100 + disk_activity / 1000 + net_activity / 1000) / 3)
            
            return activity_score
        except:
            return 0.5

    def calculate_threat_level(self):
        """Calculate threat level"""
        try:
            threat_score = 0
            
            if self.is_defender_active():
                threat_score += 0.3
            
            if self.is_sysmon_active():
                threat_score += 0.3
            
            process_count = len(list(psutil.process_iter()))
            if process_count > 200:
                threat_score += 0.2
            elif process_count > 150:
                threat_score += 0.1
            
            memory_percent = psutil.virtual_memory().percent
            if memory_percent > 80:
                threat_score += 0.2
            elif memory_percent > 60:
                threat_score += 0.1
            
            return min(1.0, threat_score)
        except:
            return 0.5

