    def detect_antivirus_products(self):
        """Detect antivirus products"""
        try:
            av_products = []
            
            av_registry_paths = [
                r"SOFTWARE\Microsoft\Windows Defender",
                r"SOFTWARE\McAfee",
                r"SOFTWARE\Symantec",
                r"SOFTWARE\KasperskyLab",
                r"SOFTWARE\ESET",
                r"SOFTWARE\Avast",
                r"SOFTWARE\AVG",
                r"SOFTWARE\Malwarebytes",
                r"SOFTWARE\TrendMicro",
                r"SOFTWARE\Sophos"
            ]
            
            for path in av_registry_paths:
                try:
                    key = winreg.OpenKey(winreg.HKEY_LOCAL_MACHINE, path, 0, winreg.KEY_READ)
                    av_products.append(path.split('\\')[-1])
                    winreg.CloseKey(key)
                except:
                    continue
            
            av_processes = [
                'msmpeng.exe', 'mcshield.exe', 'avp.exe', 'egui.exe', 'avast.exe',
                'avgui.exe', 'mbam.exe', 'tmntsrv.exe', 'sophosui.exe'
            ]
            
            for proc in psutil.process_iter(['name']):
                if proc.info['name'] in av_processes:
                    av_products.append(proc.info['name'])
            
            return list(set(av_products))
            
        except Exception as e:
            self.debug_log(f'Antivirus detection error: {e}')
            return []

