    def check_known_malware_indicators(self):
        """Check known malware indicators"""
        try:
            indicators = []
            
            suspicious_names = ['svchosts.exe', 'csrsss.exe', 'lsasss.exe', 'winlogoon.exe']
            
            suspicious_folders = [
                r'%TEMP%\svchost',
                r'%TEMP%\csrss',
                r'%APPDATA%\Microsoft\Windows\svchost',
                r'%LOCALAPPDATA%\Microsoft\Windows\csrss'
            ]
            
            for proc in psutil.process_iter(['name', 'exe']):
                if proc.info['name'] in suspicious_names:
                    indicators.append(f'suspicious_process:{proc.info["name"]}')
                
                if proc.info['exe']:
                    for folder in suspicious_folders:
                        if folder in proc.info['exe']:
                            indicators.append(f'suspicious_location:{proc.info["exe"]}')
            
            return indicators
            
        except Exception as e:
            self.debug_log(f'Malware indicator check error: {e}')
            return []

    def detect_suspicious_processes(self):
        """Detect suspicious processes"""
        try:
            suspicious = []
            
            for proc in psutil.process_iter(['name', 'cpu_percent']):
                if proc.info['cpu_percent'] > 80:
                    suspicious.append(f'high_cpu:{proc.info["name"]}')
            
            for proc in psutil.process_iter(['name', 'memory_percent']):
                if proc.info['memory_percent'] > 50:
                    suspicious.append(f'high_memory:{proc.info["name"]}')
            
            for proc in psutil.process_iter(['name', 'pid']):
                try:
                    connections = proc.connections()
                    if len(connections) > 50:
                        suspicious.append(f'many_connections:{proc.info["name"]}')
                except:
                    continue
            
            return suspicious
            
        except Exception as e:
            self.debug_log(f'Suspicious process detection error: {e}')
            return []

    def detect_anomalies(self):
        """Detect anomalies"""
        try:
            anomalies = []
            
            cpu_percent = psutil.cpu_percent(interval=1)
            if cpu_percent > 90:
                anomalies.append('high_cpu_usage')
            
            memory_percent = psutil.virtual_memory().percent
            if memory_percent > 95:
                anomalies.append('high_memory_usage')
            
            disk_percent = psutil.disk_usage('/').percent
            if disk_percent > 95:
                anomalies.append('high_disk_usage')
            
            net_io = psutil.net_io_counters()
            if net_io.bytes_sent > 1000000000:
                anomalies.append('high_network_activity')
            
            return anomalies
            
        except Exception as e:
            self.debug_log(f'Anomaly detection error: {e}')
            return []

