    def get_idle_time(self):
        """Get idle time"""
        try:
            import ctypes
            last_input = ctypes.c_ulong()
            ctypes.windll.user32.GetLastInputInfo(ctypes.byref(last_input))
            idle_time = (ctypes.windll.kernel32.GetTickCount() - last_input.value) / 1000
            return idle_time
        except:
            return 0

