    def calculate_neural_confidence(self, inputs, output):
        """Calculate neural network confidence"""
        
        try:
            input_quality = 0
            valid_inputs = 0
            
            for key, value in inputs.items():
                if isinstance(value, (int, float)) and 0 <= value <= 1:
                    input_quality += 1 - abs(value - 0.5)
                    valid_inputs += 1
            
            if valid_inputs > 0:
                input_quality /= valid_inputs
            else:
                input_quality = 0.5
            
            output_consistency = 1 - abs(output['stealth'] + output['aggression'] - 1.0)
            
            confidence = (input_quality * 0.6 + output_consistency * 0.4) * 0.9 + 0.1
            
            return max(0.1, min(0.95, confidence))
            
        except Exception as e:
            self.debug_log(f'Confidence calculation error: {e}')
            return 0.5

