    def _start_loading_animation(self):
        self._stop_loading_animation()
        
        self.update_idletasks()
        x = self.winfo_rootx()
        y = self.winfo_rooty()
        w = self.winfo_width()
        h = self.winfo_height()
        screenshot = ImageGrab.grab(bbox=(x, y, x + w, y + h))
        blurred = screenshot.filter(ImageFilter.GaussianBlur(radius=8))
        self._blur_imgtk = ImageTk.PhotoImage(blurred)

        self.loading_overlay = tk.Toplevel(self)
        self.loading_overlay.overrideredirect(True)
        self.loading_overlay.geometry(f"{w}x{h}+{x}+{y}")
        self.loading_overlay.lift()
        self.loading_overlay.grab_set()
        self.apply_streamproof_to_window(self.loading_overlay)

        blur_label = tk.Label(self.loading_overlay, image=self._blur_imgtk)
        blur_label.place(x=0, y=0, relwidth=1, relheight=1)

        self.infinity_canvas = tk.Canvas(
            self.loading_overlay,
            width=self.ANIM_WIDTH,
            height=self.ANIM_HEIGHT,
            highlightthickness=0
        )
        self.infinity_canvas.place(relx=0.5, rely=0.5, anchor="center")
        
        self.loading_active = True
        self.infinity_angle = 0
        self._animate_infinity()
        
        self.inject_btn.config(state=tk.DISABLED)
        self.clean_btn.config(state=tk.DISABLED)

    def _animate_infinity(self):
        if self.loading_active:
            self.infinity_canvas.delete("all")
            self.infinity_angle = (self.infinity_angle + 4) % 360
            
            cx = self.ANIM_WIDTH // 2
            cy = self.ANIM_HEIGHT // 2
            size = 60
            
            points = []
            for t in range(0, 360, 5):
                rad = math.radians(t + self.infinity_angle)
                x = cx + size * math.sin(rad)
                y = cy + (size/2) * math.sin(2 * rad)
                points.append((x, y))
            
            for i in range(len(points)-1):
                progress = i / len(points)
                r = 255
                g = b = int(255 * (1 - progress))
                color = f"#{r:02x}{g:02x}{b:02x}"
                
                self.infinity_canvas.create_line(
                    points[i][0], points[i][1],
                    points[i+1][0], points[i+1][1],
                    fill=color,
                    width=5,
                    capstyle="round",
                    smooth=True
                )
            
            self.after(16, self._animate_infinity)

    def _stop_loading_animation(self):
        if getattr(self, 'loading_active', False):
            self.loading_active = False
            if hasattr(self, 'infinity_canvas'):
                self.infinity_canvas.destroy()
            if hasattr(self, 'loading_overlay'):
                self.loading_overlay.grab_release()
                self.loading_overlay.destroy()
            self.inject_btn.config(state=tk.NORMAL)
            self.clean_btn.config(state=tk.NORMAL)

        
    def hide_loading_screen(self):
        try:
            if hasattr(self, 'loading_animation_id'):
                self.loading_canvas.after_cancel(self.loading_animation_id)
            if hasattr(self, 'loading_overlay') and self.loading_overlay.winfo_exists():
                self.loading_overlay.destroy()
        except Exception as e:
            logging.warning(f"Loading screen could not be closed: {str(e)}")

    def find_active_child_process(self, parent_name):
        for proc in psutil.process_iter(['pid', 'name', 'ppid']):
            try:
                parent = psutil.Process(proc.info['ppid'])
                if parent.name().lower() == parent_name.lower():
                    return proc.info['pid'], proc.info['name']
            except:
                continue
        return None, None


