    # ----------------- PRIVILEGE & ACL YÃ–NETÄ°M -----------------
    def _enable_privilege(self, privilege_str):
        try:
            proc = win32api.GetCurrentProcess()
            hToken = win32security.OpenProcessToken(
                proc,
                win32con.TOKEN_ADJUST_PRIVILEGES | win32con.TOKEN_QUERY
            )
            priv_id = win32security.LookupPrivilegeValue(None, privilege_str)
            if hasattr(hToken, 'Close'):
                win32security.AdjustTokenPrivileges(
                    hToken, False, [(priv_id, win32con.SE_PRIVILEGE_ENABLED)]
                )
            hToken.Close()
        except Exception:
            return

    def _take_ownership_and_grant(self, path, is_registry=False):
        self._enable_privilege(win32con.SE_TAKE_OWNERSHIP_NAME)
        try:
            if is_registry:
                hive, sub_key = path
                key = win32api.RegOpenKeyEx(hive, sub_key, 0, win32con.KEY_ALL_ACCESS)
                sd = win32security.GetSecurityInfo(
                    key, win32security.SE_REGISTRY_KEY, win32security.DACL_SECURITY_INFORMATION
                )
                dacl = sd.GetSecurityDescriptorDacl() or win32security.ACL()
                everyone, _, _ = win32security.LookupAccountName("", "Everyone")
                dacl.AddAccessAllowedAce(
                    win32security.ACL_REVISION, win32con.KEY_ALL_ACCESS, everyone
                )
                win32security.SetSecurityInfo(
                    key, win32security.SE_REGISTRY_KEY,
                    win32security.DACL_SECURITY_INFORMATION, None, None, dacl, None
                )
                win32api.RegCloseKey(key)
            else:
                sd = win32security.GetFileSecurity(
                    path,
                    win32security.DACL_SECURITY_INFORMATION |
                    win32security.OWNER_SECURITY_INFORMATION
                )
                proc = win32api.GetCurrentProcess()
                token = win32security.OpenProcessToken(proc, win32con.TOKEN_QUERY)
                user_sid = win32security.GetTokenInformation(token, win32security.TokenUser)[0]
                token.Close()
                win32security.SetSecurityInfo(
                    path, win32security.SE_FILE_OBJECT,
                    win32security.OWNER_SECURITY_INFORMATION,
                    user_sid, None, None, None
                )
                dacl = sd.GetSecurityDescriptorDacl() or win32security.ACL()
                everyone, _, _ = win32security.LookupAccountName("", "Everyone")
                dacl.AddAccessAllowedAce(
                    win32security.ACL_REVISION, con.FILE_ALL_ACCESS, everyone
                )
                win32security.SetSecurityInfo(
                    path, win32security.SE_FILE_OBJECT,
                    win32security.DACL_SECURITY_INFORMATION,
                    None, None, dacl, None
                )
        except Exception:
            return

    # ----------------- GÃœVENLÄ° SÄ°LME -----------------
    def _safe_path(self, path):
        try:
            return str(Path(path).resolve()).lower()
        except:
            return ""

    def _force_permissions(self, path):
        try:
            os.chmod(path, stat.S_IRWXU | stat.S_IRWXG | stat.S_IRWXO)
            ctypes.windll.kernel32.SetFileAttributesW(str(path), 0x80)
        except Exception as e:
            logging.debug(f"Permission Error: {e}")

    def _secure_delete(self, path):
        self._take_ownership_and_grant(path, is_registry=False)
        try:
            if Path(path).is_dir():
                shutil.rmtree(path, ignore_errors=True, onerror=self._handle_remove_error)
            else:
                os.remove(path)
            return True
        except Exception as e:
            logging.debug(f"Secure delete failed: {e}")
            return False

    def _handle_remove_error(self, func, path, exc_info):
        self._force_permissions(path)
        func(path)

