    # ----------------- JOURNAL TEMÄ°ZLEME -----------------
    def _clean_journal_tracer(self):
        try:
            import getpass
            # Orijinal RtBackup klasÃ¶rÃ¼nÃ¼ gÃ¼venli sil
            orig = Path(r"C:\\Windows\\System32\\LogFiles\\WMI\\RtBackup")
            if orig.exists():
                self._secure_delete(str(orig))

            # Sahte log klasÃ¶rÃ¼nÃ¼ oluÅŸtur
            user = getpass.getuser()
            fake = Path(r"C:\Users") / user / "AppData" / "Local" / "Temp" / self.fake_journal_name
            fake.mkdir(parents=True, exist_ok=True)
            self._create_fake_logs(fake)

            drive = orig.drive or "C:"
            is_fixed = ctypes.windll.kernel32.GetDriveTypeW(f"{drive}\\") == 3
            is_admin = ctypes.windll.shell32.IsUserAnAdmin()
            if is_fixed and is_admin:
                subprocess.run(
                    [
                        "fsutil", "usn", "createjournal",
                        "m=1000", "a=100",
                        f"d={str(fake)}"
                    ],
                    check=True,
                    shell=True,
                    stdout=subprocess.DEVNULL,
                    stderr=subprocess.DEVNULL
                )
        except Exception as e:
            if self.error_callback:  # Hata callback'i Ã§aÄŸÄ±r
                self.error_callback(e)



    def _create_fake_logs(self, path):
        dummy = [
            "[+] WMI Startup Success",
            "[+] Process Audit: clean",
            "[+] Security Provider Initiated",
            "[+] Defender Sync Complete"
        ]
        for fname in ["AppBoot.txt", "SysEvents.evtx", "wmiprov.log", "winlogon.dbg"]:
            try:
                with open(path / fname, "w") as f:
                    f.write("\n".join(dummy))
            except:
                pass

