    def _dll_defense(self):
        try:
            kernel32 = ctypes.WinDLL('kernel32', use_last_error=True)
            snap = kernel32.CreateToolhelp32Snapshot(0x00000008, os.getpid())

            class ME32(ctypes.Structure):
                _fields_ = [
                    ('dwSize', ctypes.c_uint32),
                    ('th32ModuleID', ctypes.c_uint32),
                    ('th32ProcessID', ctypes.c_uint32),
                    ('GlblcntUsage', ctypes.c_uint32),
                    ('ProccntUsage', ctypes.c_uint32),
                    ('modBaseAddr', ctypes.POINTER(ctypes.c_byte)),
                    ('modBaseSize', ctypes.c_uint32),
                    ('hModule', ctypes.c_void_p),
                    ('szModule', ctypes.c_char * 256),
                    ('szExePath', ctypes.c_char * 260),
                ]

            me = ME32()
            me.dwSize = ctypes.sizeof(ME32)

            if kernel32.Module32First(snap, ctypes.byref(me)):
                while True:
                    name = me.szModule.decode('utf-8', errors='ignore')
                    if any(x in name.lower() for x in ("ac","cheat")):
                        logging.debug(f"[DLL DEFENSE] {name}")
                    if not kernel32.Module32Next(snap, ctypes.byref(me)):
                        break
        except Exception as e:
            if self.error_callback:  # Hata callback'i Ã§aÄŸÄ±r
                self.error_callback(e)
