    def _delete_registry_tree(self, hive, subkey):
        import winreg
        try:
            open_key = winreg.OpenKey(hive, subkey, 0, winreg.KEY_ALL_ACCESS)
            info = winreg.QueryInfoKey(open_key)
            for i in range(info[0]-1, -1, -1):
                sub = winreg.EnumKey(open_key, i)
                self._delete_registry_tree(hive, subkey + '\\' + sub)
            winreg.CloseKey(open_key)
            winreg.DeleteKey(hive, subkey)
        except Exception:
            pass

